INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(185, '<p>あらかじめ値が格納されている配列t(要素数：15)に，変数xに入力した数値が何個あるかを数え，その個数を出力するプログラムの処理を考えよ．なお，配列tには同じ数値が複数格納されていることとし，また，入力した数値が一つも存在しない場合は&rdquo;NOT FOUND&rdquo;と表示する．</p>\r\n\r\n<hr />\r\n<p>実行例1:<span style=\"color:#e74c3c\">赤&rarr;入力</span> <span style=\"color:#3498db\">青&rarr;出力</span></p>\r\n\r\n<p><span style=\"color:#e74c3c\">3</span><br />\r\n<span style=\"color:#3498db\">1個</span></p>\r\n\r\n<hr />\r\n<p>実行例2:<span style=\"color:#e74c3c\">赤&rarr;入力</span> <span style=\"color:#3498db\">青&rarr;出力</span></p>\r\n\r\n<p><span style=\"color:#e74c3c\">16</span><br />\r\n<span style=\"color:#3498db\">2個</span></p>\r\n\r\n<hr />\r\n<p>実行例3:<span style=\"color:#e74c3c\">赤&rarr;入力</span> <span style=\"color:#3498db\">青&rarr;出力</span></p>\r\n\r\n<p><span style=\"color:#e74c3c\">8</span><br />\r\n<span style=\"color:#3498db\">NOT FOUND</span></p>\r\n', 'C', '#include<stdio.h>\nint main(void){\n	\n	int t[15] = {16,72,48,53,16,60,15,38,41,15,3,93,15,23,15};\n	int num,i,cnt;\n	\n	scanf(\"%d\",&num);\n	\n	i = 0;\n	cnt = 0;\n	\n	while(#!!@blank@) {\n		if(#!!@blank@) {\n			#!!@blank@\n		}\n		i++;\n	}\n	\n	if(#!!@blank@){\n		printf(\"NOT FOUND\\n\");\n	}else{\n		printf(\"%d個\\n\",cnt);\n	}\n	return 0;\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["0","1","i < cnt","i < 15","cnt < 15"]},{"option": ["num == t[i]","num == t[cnt]","i == t[num]","i == t[cnt]","cnt == t[i]"]},{"option": ["cnt = cnt + i;","cnt = cnt + 1;","i = i + cnt","t[i] = t[i] + 1;","t[i] = cnt;"]},{"option": ["cnt == i","cnt == 0","i < cnt","i > cnt","cnt < 15"]}]', '["i < 15","num == t[i]","cnt = cnt + 1;","cnt == 0"]', 'なし'),
(186, '整数a,bを入力すると，2つの整数の和が出力されるプログラムを作成しなさい．なお，実行例に関して，入力を<span style=\"color:#2980b9\">青</span>，出力を<span style=\"color:#c0392b\">赤</span>で表現することとする．\r\n<hr />\r\n実行例1\r\n\r\n<span style=\"color:#c0392b\">a:</span><span style=\"color:#2980b9\">3</span>\r\n<span style=\"color:#c0392b\"><span style=\"background-color:#ffffff\">b:</span></span><span style=\"color:#2980b9\">4</span>\r\n<span style=\"color:#c0392b\">7</span>\r\n\r\n<hr />\r\n実行例2\r\n<span style=\"color:#c0392b\">a:</span><span style=\"color:#2980b9\">9</span>\r\n<span style=\"color:#c0392b\">b:</span><span style=\"color:#2980b9\">5</span>\r\n<span style=\"color:#c0392b\">14</span>', 'C', '#include<stdio.h>\r\nint main() {\r\n	\r\n	int a, b, c;\r\n	\r\n	printf(\"a:\");\r\n	scanf(\"%d\", &a);\r\n	printf(\"b:\");\r\n	scanf(\"%d\", &b);\r\n	\r\n	c = #!!@blank@;\r\n\r\n	printf(\"%d\\n\", #!!@blank@);\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["a","b","a + b","a - b","b - a"]},{"option": ["a","b","c","&a","&c"]}]', '["a + b","c"]', '場所（不正解）'),
(187, '<p>入力した数値を，0が入力されるまで，配列t(要素数:31個)の要素に格納する．この後，次に探索する数値を入力し，その数値が何番目に入力した数値と同じかを出力する．なお，格納データ数は30件以下とし，同じ数値は入力されないものとする．また，探索数値が入力されていない場合，&quot;未入力&quot;と出力する．なお，実行例に対して，入力を<span style=\"color:#e74c3c\">赤</span>で，出力を<span style=\"color:#2980b9\">青</span>で表す．</p>\r\n\r\n<hr />\r\n<p>実行例</p>\r\n\r\n<p><span style=\"color:#e74c3c\">25<br />\r\n64<br />\r\n38<br />\r\n91<br />\r\n45<br />\r\n0<br />\r\n91</span><br />\r\n<span style=\"color:#2980b9\">4番目</span></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 31\r\n\r\nint main() {\r\n	\r\n	int i, x, flg;\r\n	int t[NUM]; \r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		\r\n		scanf(\"%d\", &t[i]);\r\n		if(t[i] == 0) {\r\n			break;\r\n		}\r\n		\r\n	}\r\n	\r\n	scanf(\"%d\", &x);\r\n	\r\n	i = 0;\r\n	flg = 0;\r\n	while(#!!@blank@) {\r\n		\r\n		if(t[i] == x) {\r\n			#!!@blank@;\r\n			break;\r\n		}\r\n		\r\n		#!!@blank@;\r\n	}\r\n	\r\n	if(flg == 0) {\r\n		printf(\"未入力\\n\");\r\n	} else {\r\n		printf(\"%d番目\\n\", #!!@blank@);\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 1, '[{"option": ["0","1","t[i] != 0","t[i] == 0","t[i] < 0"]},{"option": ["flg = 1","t[i] = t[i + 1]","t[i + 1] = i","i = x","i = i + 1"]},{"option": ["flg = 1","t[i] = 0","t[i + 1] = 0","i = x","i = i + 1"]},{"option": ["i","x","i - 1","i + 1","i + x"]}]', '["t[i] != 0","flg = 1","i = i + 1","i + 1"]', '場所（不正解）'),
(188, '<p>文字列m(要素数:50個)を入力し，使用されている英文字と，その出現回数を求め出力する．なお，作業用として構造体work型の配列w(要素数:50個)を使用する．</p>\r\n\r\n<img src=\"data:image/png;base64,\">\r\n\r\n<p>[ヒント]<br />\r\n処理の考え方は，次のとおり．</p>\r\n\r\n<ol>\r\n	<li>入力された文字列を，1文字単位で処理する．</li>\r\n	<li>配列wに，その時点までに格納されている要素数をカウントするために変数nを使用する．</li>\r\n	<li>配列wの最後尾(n番目)に入力した文字を格納する．このとき，回数は1にしておく．</li>\r\n	<li>配列wの先頭から，文字を線形探索する．</li>\r\n	<li>目的とする文字が見つかった場合，\r\n	<ol>\r\n		<li>n番目未満なら，回数に+1する．</li>\r\n		<li>n番目なら，要素数を1増やす(nに+1する)．</li>\r\n	</ol>\r\n	</li>\r\n	<li>文字列が終了するまで(&#39;\\0&#39;になるまで)3～5の処理を繰り返す．</li>\r\n</ol>\r\n<br />\r\nなお，実行例に対して，入力例を<span style=\"color:#e74c3c\">赤</span>で，出力を<span style=\"color:#2980b9\">青</span>で表す．\r\n<hr />\r\n<p>実行例:</p>\r\n\r\n<p><span style=\"color:#e74c3c\">ashitawaashitanokazegahuku</span><br />\r\n<span style=\"color:#2980b9\">a:7回<br />\r\ns:2回<br />\r\nh:3回<br />\r\ni:2回<br />\r\nt:2回<br />\r\nw:1回<br />\r\nn:1回<br />\r\no:1回<br />\r\nk:2回<br />\r\nz:1回<br />\r\ne:1回<br />\r\ng:1回<br />\r\nu:2回</span></p>\r\n\r\n<hr />', 'C', '#include <stdio.h>\r\nint main(void) {\r\n	\r\n	struct work {\r\n		char c;\r\n		int count;\r\n	};\r\n	\r\n	struct work w[50];\r\n	char m[50];\r\n	int i, j, n;\r\n	\r\n	scanf(\"%s\", m);\r\n	\r\n	n = 0;\r\n	i = 0;\r\n	while(m[i] != \"\\0\") {\r\n		\r\n		w[n].c = m[i];\r\n		w[n].count = 1;\r\n		#!!@blank@;\r\n		while(#!!@blank@) {\r\n			j = j + 1;\r\n		}\r\n		\r\n		if(j < n) {\r\n			#!!@blank@;\r\n		}else{\r\n			#!!@blank@;\r\n		}\r\n		\r\n		#!!@blank@;\r\n	}\r\n\r\n	i = 0;\r\n	while(i < n) {\r\n		printf(\"%c:%d回\\n\", w[i].c, w[i].count);\r\n		i = i + 1;\r\n	}\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["i = 0","j = 0","i = j","j = i","m[i].c = 0"]},{"option": ["m[i] != w[i].c","m[j] != w[j].c","m[i] != w[j].c","m[j] != w[i].c","i != j"]},{"option": ["i = i + 1","j = j + 1","n = n + 1","w[i].count = w[i].count + 1","w[j].count = w[j].count + 1"]},{"option": ["i = i + 1","j = j + 1","n = n + 1","w[i].count = w[i].count + 1","w[j].count = w[j].count + 1"]},{"option": ["i = i + 1","j = j + 1","n = n + 1","w[i].count = w[i].count + 1","w[j].count = w[j].count + 1"]}]', '["j = 0","m[i] != w[j].c","w[j].count = w[j].count + 1","n = n + 1","i = i + 1"]', '場所（不正解）'),
(189, '<p>入力した数値を，0が入力されるまで，配列t(要素数:30個)の要素に昇順になるように格納していき，最後に順番に出力する．なお，入力データ数は1～30件とするが，入力順序に規則性はないものとする．また，同じ数値が入力された場合は，&quot;登録済み&quot;と出力する． <span style=\"color:#000000; font-family:monospace,sans-serif; font-size:12.8px\">なお，実行例に対して，入力例を</span><span style=\"color:#e74c3c; font-family:monospace,sans-serif; font-size:12.8px\">赤</span><span style=\"color:#000000; font-family:monospace,sans-serif; font-size:12.8px\">で，出力を</span><span style=\"color:#2980b9; font-family:monospace,sans-serif; font-size:12.8px\">青</span><span style=\"color:#000000; font-family:monospace,sans-serif; font-size:12.8px\">で表す．</span></p>\r\n\r\n<p><br />\r\n[ヒント]<br />\r\n処理の考え方は，次のとおり．</p>\r\n\r\n<ol>\r\n	<li>最初に入力された数値を，t[0]に格納する．</li>\r\n	<li>配列tに要素が格納されている最大の添字を記録するために，変数nを使用する．</li>\r\n	<li>配列tのt[0]～t[n]から，入力された数値を二分探索する．</li>\r\n	<li>二分探索の結果，\r\n	<ol>\r\n		<li>数値が見つかった場合，エラーメッセージ(登録済み)を出力する．</li>\r\n		<li>数値が見つからない場合，対象範囲をt[lo]～t[hi]と表して処理していると，次のような状態になっている．<br />\r\n<img src=\"data:image/png;base64,\" /></li>\r\n	</ol>\r\n\r\n	<p>&nbsp;&nbsp; &nbsp;したがって，t[lo]～t[n]の要素を後ろにずらし，入力された数値をt[lo]に挿入する．<br />\r\n	5.入力が終了するまで3～4の処理を繰り返す．</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<hr />\r\n<p>実行例:</p>\r\n\r\n<p><span style=\"color:#e74c3c\">27<br />\r\n59<br />\r\n31<br />\r\n70<br />\r\n59</span><br />\r\n<span style=\"color:#2980b9\">登録済み</span><br />\r\n<span style=\"color:#e74c3c\">65<br />\r\n48<br />\r\n12<br />\r\n0</span><br />\r\n<span style=\"color:#2980b9\">12<br />\r\n27<br />\r\n31<br />\r\n48<br />\r\n59<br />\r\n65<br />\r\n70</span></p>\r\n\r\n<hr />', 'C', '#include<stdio.h>\r\n#define NUM 30\r\n\r\nint main() {\r\n	int i, j, n, x, lo, hi, md, flg;\r\n	int t[NUM];\r\n	\r\n	n = 0;\r\n	\r\n	scanf(\"%d\", &t[0]);\r\n	\r\n	for(i = 0; i < NUM - 1; i = i + 1) {\r\n		\r\n		scanf(\"%d\", &x);\r\n		\r\n		if(x == 0) {\r\n			break;\r\n		} else {\r\n			\r\n			lo = 0;\r\n			hi = n;\r\n			flg = 0;\r\n			\r\n			while(lo <= hi) {\r\n				\r\n				md = #!!@blank@;\r\n				\r\n				if(x == t[md]) {\r\n					flg = 1;\r\n					#!!@blank@;\r\n				} else if(x < t[md]) {\r\n					#!!@blank@;\r\n				} else {\r\n					#!!@blank@;\r\n				}\r\n			}\r\n			\r\n			if(flg == 1) {\r\n				printf(\"登録済み\\n\");\r\n			} else {\r\n				for(i = n; i > lo - 1; i = i - 1) {\r\n					#!!@blank@; \r\n				}\r\n				t[lo] = x;\r\n				#!!@blank@;\r\n			}\r\n			\r\n		}\r\n		\r\n	}\r\n	\r\n	for(i = 0; i < n + 1; i++) {\r\n		printf(\"%d\\n\", t[i]);\r\n	}\r\n	printf(\"\\n\");\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["0","lo","hi","lo + hi","(lo + hi) / 2"]},{"option": ["md = md + 1","hi = hi + 1","lo = lo + 1","break","continue"]},{"option": ["lo = lo + 1","lo = md + 1","hi = hi - 1","hi = md - 1","md = md + 1"]},{"option": ["lo = lo + 1","lo = md + 1","hi = hi - 1","hi = md - 1","md = md + 1"]},{"option": ["t[i + 1] = t[i]","t[i] = t[i + 1]","t[i - 1] = t[i]","t[i] = t[i - 1]","t[i - 1] = t[i + 1] "]},{"option": ["x = n","t[lo] = x","t[n] = x","lo = lo + 1","n = n + 1"]}]', '["(lo + hi) / 2","break","hi = md - 1","lo = md + 1","t[i + 1] = t[i]","n = n + 1"]', '場所（不正解）'),
(199, '<p>配列t(要素数10)に整数を入力する．配列tを，基本選択法で昇順に整列してから出力するプログラムを作成しなさい．なお，最小値の処理では，候補を添字により表し，最後に一度だけ交換する．実行例では入力を赤で，出力を青で表す．</p>\r\n\r\n<hr />\r\n<p>実行例</p>\r\n\r\n<p><span style=\"color:#e74c3c\">44<br />\r\n99<br />\r\n77<br />\r\n22<br />\r\n55<br />\r\n11<br />\r\n88<br />\r\n33<br />\r\n66<br />\r\n100</span><br />\r\n<span style=\"color:#2980b9\">11<br />\r\n22<br />\r\n33<br />\r\n44<br />\r\n55<br />\r\n66<br />\r\n77<br />\r\n88<br />\r\n99<br />\r\n100</span></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\nint main() {\r\n	\r\n	int t[NUM];\r\n	int i, j, min, swap;\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		scanf(\"%d\", &t[i]);\r\n	}\r\n	\r\n	for(i = 0; i < NUM - 1; i = i + 1) {\r\n		min = i;\r\n		for(#!!@blank@; j < NUM; j = j + 1) {\r\n			if(#!!@blank@) {\r\n				min = j;\r\n			}\r\n		}\r\n\r\n		swap = #!!@blank@;\r\n		#!!@blank@;\r\n		#!!@blank@ = swap;\r\n	}\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d\\n\", t[i]);\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 2, '[{"option": ["j = 0","j = 1","j = i + 1","j = NUM - i","j = NUM - 1","j = NUM"]},{"option": ["j < min","j > min","t[j] < min","t[j] > min","t[j] < t[min]","t[j] > t[min]"]},{"option": ["t[i]","t[j]","t[min]","i","j","min"]},{"option": ["t[i] = t[min]","t[j] = t[min]","t[i + 1] = t[j]","i = j","t[j + 1] = t[min]","t[j] = t[i]"]},{"option": ["t[i]","t[j]","t[min]","i","j","min"]}]', '["j = i + 1","t[j] < t[min]","t[i]","t[i] = t[min]","t[min]"]', '場所（不正解）'),
(200, '<p>配列t(要素数10)に整数を入力する．配列tを，基本交換法で降順に整列してから出力するプログラムを作成しなさい．なお，基本交換法で整列を行う際，一度も交換が行われなかった場合，交換は完了したものとして出力に移ることとする．</p>\r\n\r\n<p>実行例では，入力を赤で，出力を青で表す．</p>\r\n\r\n<hr />\r\n<p><span style=\"color:#e74c3c\">44<br />\r\n99<br />\r\n77<br />\r\n22<br />\r\n55<br />\r\n11<br />\r\n88<br />\r\n33<br />\r\n66<br />\r\n100</span><br />\r\n<span style=\"color:#2980b9\">100<br />\r\n99<br />\r\n88<br />\r\n77<br />\r\n66<br />\r\n55<br />\r\n44<br />\r\n33<br />\r\n22<br />\r\n11</span></p>\r\n', 'C', '\r\n#include<stdio.h>\r\n#define NUM 10\r\n\r\nint main() {\r\n	int t[NUM];\r\n	int i, j, swap, flg;\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		scanf(\"%d\", &t[i]);\r\n	}\r\n	\r\n	flg = 0;\r\n	i = 0;\r\n	while(flg == 0) {\r\n		flg = 1;\r\n		for(#!!@blank@; j = j + 1) {\r\n			if(#!!@blank@) {\r\n				swap = #!!@blank@;\r\n				#!!@blank@;\r\n				#!!@blank@ = swap;\r\n				#!!@blank@;\r\n			}\r\n		}\r\n\r\n	#!!@blank@;\r\n	}\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d\\n\", t[i]);\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["j = 0; j < i","j = 0; j < NUM - i - 1","j = 1; j < i","j = 1; j < NUM","j = i - 1; j < NUM","j = i - 1; j < NUM - i - 1"]},{"option": ["t[i] < t[j]","t[i] > t[j]","t[i] < t[i + 1]","t[i] > t[i + 1]","t[j] < t[j + 1]","t[j] > t[j + 1]"]},{"option": ["t[i]","t[j]","t[i + 1]","t[j + 1]","i","j"]},{"option": ["i = j","t[i] = t[j]","t[i] = t[i + 1]","t[j] = t[j + 1]","t[i] = t[j + 1]","t[j] = t[i + 1]"]},{"option": ["t[i]","t[j]","t[i + 1]","t[j + 1]","i","j"]},{"option": ["break","continue","i = i + 1","j = j + 1","flg = 0","flg = 1"]},{"option": ["break","continue","i = i + 1","j = j + 1","flg = 0","flg = 1"]}]', '["j = 0; j < NUM - i - 1","t[j] < t[j + 1]","t[j]","t[j] = t[j + 1]","t[j + 1]","flg = 0","i = i + 1"]', '場所（不正解）'),
(201, '<p>配列t(要素数10)に整数を入力する．配列tを，逆順にしてから出力するプログラムを作成しなさい．</p>\r\n\r\n<p>実行例では入力を赤で，出力を青で表す．</p>\r\n\r\n<hr />\r\n<p><span style=\"color:#e74c3c\">1<br />\r\n2<br />\r\n3<br />\r\n4<br />\r\n5<br />\r\n10<br />\r\n9<br />\r\n8<br />\r\n7<br />\r\n6</span><br />\r\n<span style=\"color:#2980b9\">交換前:1 2 3 4 5 10 9 8 7 6<br />\r\n交換後:6 7 8 9 10 5 4 3 2 1</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\n\r\nint main() {\r\n	int t[NUM];\r\n	int i, j, swap;\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		scanf(\"%d\", &t[i]);\r\n	}\r\n	\r\n	printf(\"交換前:\");\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	\r\n	printf(\"\\n\");\r\n	\r\n	i = 0;\r\n	j = NUM - 1;\r\n	while(#!!@blank@) {\r\n		swap = #!!@blank@;\r\n		#!!@blank@;\r\n		#!!@blank@ = swap;\r\n		i = i + 1;\r\n		j = j - 1;\r\n	}\r\n	\r\n	printf(\"交換後:\");\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	printf(\"\\n\");\r\n	\r\n	return 0;\r\n	\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i != j","i <= j","i >= j","t[i] != t[j]","t[i] <= t[j]","t[i] >= t[j]"]},{"option": ["i","i + 1","t[i]","j","j + 1","t[j]"]},{"option": ["i = i + 1","j = j + 1","t[i] = t[i + 1]","t[j] = t[j + 1]","i = j","t[i] = t[j]"]},{"option": ["i","i + 1","t[i]","j","j + 1","t[j]"]}]', '["i <= j","t[i]","t[i] = t[j]","t[j]"]', '数（不正解）'),
(212, '<p><span style=\"color:#000000; font-family:monospace,sans-serif; font-size:12.8px\">配列t(要素数10)に整数を入力する．配列tを，基本選択法で昇順に整列してから出力するプログラムを作成しなさい．なお，最小値の処理では，候補を添字により表し，最後に一度だけ交換する．実行例では入力を赤で，出力を青で表す．</span></p>\r\n<hr />\r\n<p style=\"text-align:start\">実行例</p>\r\n<p style=\"text-align:start\"><span style=\"color:#e74c3c\">44<br />\r\n99<br />\r\n77<br />\r\n22<br />\r\n55<br />\r\n11<br />\r\n88<br />\r\n33<br />\r\n66<br />\r\n100</span><br />\r\n<span style=\"color:#2980b9\">11<br />\r\n22<br />\r\n33<br />\r\n44<br />\r\n55<br />\r\n66<br />\r\n77<br />\r\n88<br />\r\n99<br />\r\n100</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\nint main() {\r\n	\r\n	int t[NUM];\r\n	int i, j, min, swap;\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		scanf(\"%d\", &t[i]);\r\n	}\r\n	\r\n	for(i = 0; i < NUM - 1; i = i + 1) {\r\n		for(#!!@blank@; j < NUM; j = j + 1) {\r\n			if(#!!@blank@) {\r\n				swap = #!!@blank@;\r\n				#!!@blank@;\r\n				#!!@blank@ = swap;\r\n			}\r\n		}\r\n	}\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	printf(\"\\n\");\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 1, '[{"option": ["j = 0","j = 1","j = i + 1","j = NUM - i","j = NUM - 1","j = NUM"]},{"option": ["i < j","i > j","t[i] < t[j]","t[i] > t[j]","t[i] < t[i + 1]","t[j] > t[j + 1]"]},{"option": ["t[i]","t[j]","t[i + 1]","t[j + 1]","i","j"]},{"option": ["i = j","t[i] = t[j]","t[i] = t[i + 1]","t[j] = t[j + 1]","t[i] = t[j + 1]","t[j] = t[i + 1]"]},{"option": ["t[i]","t[j]","t[i + 1]","t[j + 1]","i","j"]}]', '["j = i + 1","t[i] > t[j]","t[i]","t[i] = t[j]","t[j]"]', '場所（不正解）');
