(216, '<p>配列の中身を逆順にするプログラムを作成しましょう．<br />\r\nこれより具体例を紹介します．まず配列tを4&times;4の配列とします．</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n			<td style=\"text-align:center\">t[0][j]</td>\r\n			<td style=\"text-align:center\">t[1][j]</td>\r\n			<td style=\"text-align:center\">t[2][j]</td>\r\n			<td style=\"text-align:center\">t[3][j]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][0]</td>\r\n			<td style=\"text-align:center\">1</td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][1]</td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][2]</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">6</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][3]</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">6</td>\r\n			<td style=\"text-align:center\">7</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>まず，t[0][0]とt[3][3]の中身を入れ替えます．</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n			<td style=\"text-align:center\">t[0][j]</td>\r\n			<td style=\"text-align:center\">t[1][j]</td>\r\n			<td style=\"text-align:center\">t[2][j]</td>\r\n			<td style=\"text-align:center\">t[3][j]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][0]</td>\r\n			<td style=\"text-align:center\"><span style=\"color:#e74c3c\"><strong>7</strong></span></td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][1]</td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][2]</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">6</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][3]</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">6</td>\r\n			<td style=\"text-align:center\"><span style=\"color:#e74c3c\"><strong>1</strong></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>次に，t[0][1]とt[2][3]の中身を入れ替えます．</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n			<td style=\"text-align:center\">t[0][j]</td>\r\n			<td style=\"text-align:center\">t[1][j]</td>\r\n			<td style=\"text-align:center\">t[2][j]</td>\r\n			<td style=\"text-align:center\">t[3][j]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][0]</td>\r\n			<td style=\"text-align:center\">7</td>\r\n			<td style=\"text-align:center\"><span style=\"color:#e74c3c\"><strong>6</strong></span></td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][1]</td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][2]</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">6</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][3]</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\"><span style=\"color:#e74c3c\"><strong>2</strong></span></td>\r\n			<td style=\"text-align:center\">1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>この交換を以下の順番で行います．</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n			<td style=\"text-align:center\">t[0][j]</td>\r\n			<td style=\"text-align:center\">t[1][j]</td>\r\n			<td style=\"text-align:center\">t[2][j]</td>\r\n			<td style=\"text-align:center\">t[3][j]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][0]</td>\r\n			<td style=\"text-align:center\"><sup>①</sup>7</td>\r\n			<td style=\"text-align:center\"><sup>②</sup>6</td>\r\n			<td style=\"text-align:center\"><sup>③</sup>3</td>\r\n			<td style=\"text-align:center\"><sup>④</sup>4</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][1]</td>\r\n			<td style=\"text-align:center\"><sup>⑤</sup>2</td>\r\n			<td style=\"text-align:center\"><sup>⑥</sup>3</td>\r\n			<td style=\"text-align:center\"><sup>⑦</sup>4</td>\r\n			<td style=\"text-align:center\"><sup>⑧</sup>5</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][2]</td>\r\n			<td style=\"text-align:center\"><sup>⑧</sup>3</td>\r\n			<td style=\"text-align:center\"><sup>⑦</sup>4</td>\r\n			<td style=\"text-align:center\"><sup>⑥</sup>5</td>\r\n			<td style=\"text-align:center\"><sup>⑤</sup>6</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][3]</td>\r\n			<td style=\"text-align:center\"><sup>④</sup>4</td>\r\n			<td style=\"text-align:center\"><sup>③</sup>5</td>\r\n			<td style=\"text-align:center\"><sup>②</sup>2</td>\r\n			<td style=\"text-align:center\"><sup>①</sup>1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>交換後</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n			<td style=\"text-align:center\">t[0][j]</td>\r\n			<td style=\"text-align:center\">t[1][j]</td>\r\n			<td style=\"text-align:center\">t[2][j]</td>\r\n			<td style=\"text-align:center\">t[3][j]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][0]</td>\r\n			<td style=\"text-align:center\">7</td>\r\n			<td style=\"text-align:center\">6</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">4</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][1]</td>\r\n			<td style=\"text-align:center\">6</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">3</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][2]</td>\r\n			<td style=\"text-align:center\">5</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">2</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[i][3]</td>\r\n			<td style=\"text-align:center\">4</td>\r\n			<td style=\"text-align:center\">3</td>\r\n			<td style=\"text-align:center\">2</td>\r\n			<td style=\"text-align:center\">1</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<hr />\r\n<p>実行例(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で表す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">交換前<br />\r\n1 2 3 4<br />\r\n2 3 4 5<br />\r\n3 4 5 6<br />\r\n4 5 6 7<br />\r\n交換後<br />\r\n7 6 5 4<br />\r\n6 5 4 3<br />\r\n5 4 3 2<br />\r\n4 3 2 1</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 4\r\n\r\nint main() {\r\n	\r\n	int i, j, swap;\r\n	int t[NUM][NUM] = {\r\n		{1, 2, 3, 4},\r\n		{2, 3, 4, 5},\r\n		{3, 4, 5, 6},\r\n		{4, 5, 6, 7}\r\n	};\r\n	\r\n	printf(\"交換前\\n\");\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		for(j = 0; j < NUM; j = j + 1) {\r\n			printf(\"%d \", t[i][j]);\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	\r\n	for(i = 0; i < NUM / 2; i = i + 1) {\r\n		for(j = 0; j < NUM; j = j + 1) {\r\n\r\n			swap = t[#!!@blank@][#!!@blank@] ;\r\n			t[#!!@blank@][#!!@blank@] = t[#!!@blank@][#!!@blank@];\r\n			t[#!!@blank@][#!!@blank@] = swap;\r\n\r\n		}\r\n	}\r\n	\r\n	printf(\"交換後\\n\");\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		for(j = 0; j < NUM; j = j + 1) {\r\n			printf(\"%d \", t[i][j]);\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i","j","NUM - i","j - NUM","NUM - (i + 1)","NUM - (j - 1)"]},{"option": ["i","j","NUM - j","i - NUM","NUM - (j + 1)","NUM - (i - 1)"]},{"option": ["i","j","NUM - i","j - NUM","NUM - (i + 1)","NUM - (j - 1)"]},{"option": ["i","j","NUM - j","i - NUM","NUM - (j + 1)","NUM - (i - 1)"]},{"option": ["i","j","i + 1","j + 1","i + j","i - j"]},{"option": ["i","j","i + 1","j + 1","i + j","i - j"]},{"option": ["i","j","i + 1","j + 1","i + j","i - j"]},{"option": ["i","j","i + 1","j + 1","i + j","i - j"]}]', '["NUM - (i + 1)","NUM - (j + 1)","NUM - (i + 1)","NUM - (j + 1)","i","j","i","j"]', '場所（不正解）'),
(217, '<p>基本挿入法を用いて配列の中身を昇順に整列するプログラムを完成させます．以下のフローチャートは要素数10の配列tを<span style=\"color:#e74c3c\"><u><strong>降順に</strong></u></span>整列するアルゴリズムを基本挿入法で作成したものです．これを<span style=\"color:#e74c3c\"><u><strong>ヒントとして</strong></u></span>考えても構いません．</p>\r\n\r\n<p>整列前</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[0]</td>\r\n			<td style=\"text-align:center\">t[1]</td>\r\n			<td style=\"text-align:center\">t[2]</td>\r\n			<td style=\"text-align:center\">t[3]</td>\r\n			<td style=\"text-align:center\">t[4]</td>\r\n			<td style=\"text-align:center\">t[5]</td>\r\n			<td style=\"text-align:center\">t[6]</td>\r\n			<td style=\"text-align:center\">t[7]</td>\r\n			<td style=\"text-align:center\">t[8]</td>\r\n			<td style=\"text-align:center\">t[9]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">33</td>\r\n			<td style=\"text-align:center\">11</td>\r\n			<td style=\"text-align:center\">0</td>\r\n			<td style=\"text-align:center\">77</td>\r\n			<td style=\"text-align:center\">99</td>\r\n			<td style=\"text-align:center\">55</td>\r\n			<td style=\"text-align:center\">22</td>\r\n			<td style=\"text-align:center\">44</td>\r\n			<td style=\"text-align:center\">88</td>\r\n			<td style=\"text-align:center\">66</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>整列後</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">t[0]</td>\r\n			<td style=\"text-align:center\">t[1]</td>\r\n			<td style=\"text-align:center\">t[2]</td>\r\n			<td style=\"text-align:center\">t[3]</td>\r\n			<td style=\"text-align:center\">t[4]</td>\r\n			<td style=\"text-align:center\">t[5]</td>\r\n			<td style=\"text-align:center\">t[6]</td>\r\n			<td style=\"text-align:center\">t[7]</td>\r\n			<td style=\"text-align:center\">t[8]</td>\r\n			<td style=\"text-align:center\">t[9]</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\">0</td>\r\n			<td style=\"text-align:center\">11</td>\r\n			<td style=\"text-align:center\">22</td>\r\n			<td style=\"text-align:center\">33</td>\r\n			<td style=\"text-align:center\">44</td>\r\n			<td style=\"text-align:center\">55</td>\r\n			<td style=\"text-align:center\">66</td>\r\n			<td style=\"text-align:center\">77</td>\r\n			<td style=\"text-align:center\">88</td>\r\n			<td style=\"text-align:center\">99</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><img src=\"data:image/png;base64,\"></p>\r\n\r\n<hr />\r\n<p>実行例(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で表す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">0 11 22 33 44 55 66 77 88 99</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\n\r\nint main() {\r\n	\r\n	int t[NUM] = {33, 11, 0, 77, 99, 55, 22, 44, 88, 66};\r\n	int i, j, swap;\r\n	\r\n	for(i = 1; i < NUM; i = i + 1) {\r\n		j = i;\r\n		while(j > 0 && #!!@blank@) {\r\n			swap = #!!@blank@;\r\n			#!!@blank@ = #!!@blank@;\r\n			#!!@blank@ = swap;\r\n			j = j - 1;\r\n		}\r\n	}\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	printf(\"\\n\");\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["t[i] > t[j]","t[j] > t[j - 1]","t[j + 1] > t[j]","t[i] < t[j]","t[j] < t[j - 1]","t[j + 1] < t[j]"]},{"option": ["i","j","t[i]","t[j]","j - 1","j + 1"]},{"option": ["i","j","t[i]","t[j]","j - 1","j + 1"]},{"option": ["i + 1","i - 1","t[i + 1]","t[i - 1]","t[j - 1]","t[j + 1]"]},{"option": ["i + 1","i - 1","t[i + 1]","t[i - 1]","t[j - 1]","t[j + 1]"]}]', '["t[j] < t[j - 1]","t[j]","t[j]","t[j - 1]","t[j - 1]"]', '数（不正解）'),
(218, '<p>testだよ</p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main() {\r\n	int a[3];\r\n	for(int i = 0; i < 3; i++) {\r\n		a[#!!@blank@] = i;\r\n	}\r\n	printf(\"%d\\n\", a[2]);\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["i","a","b","c"]}]', '["i"]', '場所（不正解）'),
(219, '<p>基本挿入法を応用して整列を行います．二次元配列を利用して整列を行います．手順は以下のようになります．</p>\r\n\r\n<ul>\r\n	<li>一次元配列tにあらかじめ異なる整数が１０個格納されています．</li>\r\n	<li>二次元配列wに配列tの要素を基本挿入法の考え方で交互に追加します．</li>\r\n	<li>全要素を二次元配列wに格納し終わったら、w[0]とw[1]の要素を先頭から比較していき，小さいほうを配列tに転記します．</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>実行例(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で表す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">0 11 22 33 44 55 66 77 88 99</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\nint main() {\r\n	int t[NUM] = {33, 11, 0, 77, 99, 55, 22, 44, 88, 66};\r\n	int w[2][NUM / 2 + 1];\r\n	int i, j, n, q, s, swap;\r\n	\r\n	for(n = 0; n < NUM; n = n + 1) {\r\n		q = n / 2;\r\n		s = n % 2;\r\n		#!!@blank@ = t[n];\r\n		for(i = 1; i < q + 1; i = i + 1) {\r\n			j = i;\r\n			while(j > 0 && w[#!!@blank@][#!!@blank@] > w[#!!@blank@][#!!@blank@]) {\r\n				swap = w[#!!@blank@][#!!@blank@];\r\n				w[#!!@blank@][#!!@blank@] = w[#!!@blank@][#!!@blank@];\r\n				w[#!!@blank@][#!!@blank@] = swap;\r\n				j = j - 1;\r\n			}\r\n		}\r\n	}\r\n	\r\n	i = 0;\r\n	j = 0;\r\n	for(n = 0; n < NUM; n = n + 1) {\r\n		if(#!!@blank@) {\r\n			if(w[0][i] < w[1][j]) {\r\n				t[n] = w[0][i];\r\n				i = i + 1;\r\n			} else {\r\n				t[n] = w[1][j];\r\n				j = j + 1;\r\n			}\r\n		} else if(i == NUM / 2) {\r\n			t[n] = w[1][j];\r\n			j = j + 1;\r\n		} else {\r\n			t[n] = w[0][i];\r\n			i = i + 1;\r\n		}\r\n	}\r\n\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	\r\n	printf(\"\\n\");\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["w[q][s]","w[s][n]","w[n][q]","w[q][n]","w[n][s]","w[s][q]"]},{"option": ["0","n","q","s","i","j"]},{"option": ["q","s","i","i + 1","j","j - 1"]},{"option": ["0","n","q","s","i","j"]},{"option": ["s","q - 1","i","i - 1","j","j - 1"]},{"option": ["0","n","q","s","i","j"]},{"option": ["0","n","q","s","i - 1","j"]},{"option": ["0","n","q","s","i","j"]},{"option": ["0","n","q","s","i - 1","j"]},{"option": ["0","n","q","s","i","j"]},{"option": ["q - 1","q + 1","i","i + 1","j - 1","j + 1"]},{"option": ["0","n","q","s","i","j"]},{"option": ["q - 1","q + 1","i","i + 1","j - 1","j + 1"]},{"option": ["i < NUM / 2 && j < NUM / 2","i < NUM && j < NUM","i < 0 && i < NUM / 2","i < 0 && i < NUM","j < 0 && j < NUM / 2","j < 0 && j < NUM"]}]', '["w[s][q]","s","j - 1","s","j","s","j","s","j","s","j - 1","s","j - 1","i < NUM / 2 && j < NUM / 2"]', '場所（不正解）');
