(220, '<p>クイックソートを用いて配列の中身を昇順に整列するプログラムを完成させます．以下のフローチャートは要素数10の配列tを降順に整列するアルゴリズムをクイックソートで作成したものです．これを<span style=\"color:#e74c3c\"><u><strong>ヒントとして</strong></u></span>考えても構いません．</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<hr />\r\n<p>実行例(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で表す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">0 11 22 33 44 55 66 77 88 99</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\n\r\nvoid sort(int, int, int[]);\r\n\r\nint main() {\r\n	int t[NUM] = {33, 11, 0, 77, 99, 55, 22, 44, 88, 66};\r\n	int lo, hi;\r\n	int i;\r\n	\r\n	lo = 0;\r\n	hi = NUM - 1;\r\n	sort(lo, hi, t);\r\n	\r\n	for(i = 0; i < NUM; i = i + 1) {\r\n		printf(\"%d \", t[i]);\r\n	}\r\n	printf(\"\\n\");\r\n\r\n	return 0;\r\n}\r\n\r\nvoid sort(int lo, int hi, int t[]) {\r\n	\r\n	if(#!!@blank@) {\r\n		return;\r\n	}\r\n	\r\n	int i, j, mid, swap;\r\n	i = #!!@blank@;\r\n	j = #!!@blank@;\r\n	mid = #!!@blank@;\r\n	while(i < j) {\r\n		while(mid > t[i] && i <= j) {\r\n			i = i + 1;\r\n		}\r\n		while(mid < t[j] && i <= j) {\r\n			j = j - 1;\r\n		}\r\n		if(i < j) {\r\n			swap = t[i];\r\n			t[i] = t[j];\r\n			t[j] = swap;\r\n		}\r\n	}\r\n	\r\n	#!!@blank@;\r\n	#!!@blank@;\r\n	\r\n	return;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["lo == hi","lo != hi","lo < hi","lo <= hi","lo > hi","lo >= hi"]},{"option": ["lo","hi","lo + hi","t[lo]","t[hi]","t[lo + hi]"]},{"option": ["t[lo]","t[hi]","t[lo + hi]","lo","hi","lo + hi"]},{"option": ["t[0]","t[lo + hi]","t[(lo + hi) / 2]","0","lo","hi"]},{"option": ["i = i + 1","i = i + j","sort(lo, j, t)","sort(hi, j, t)","sort(lo, j + 1, t)","sort(hi, j + 1, t)"]},{"option": ["j = j - 1","j = j - i","sort(j, lo, t)","sort(j, hi, t)","sort(j + 1, lo, t)","sort(j + 1, hi, t)"]}]', '["lo >= hi","lo","hi","t[(lo + hi) / 2]","sort(lo, j, t)","sort(j + 1, hi, t)"]', '場所（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(241, '<p>node個の接点からなる無効グラフを考えます．無効グラフとは，辺が向きを持たないグラフで，接点の集合と接点と接点とを結ぶ辺の集合からなります．接点iから接点jへの辺が存在するとき，配列aの要素a[i][j]を1とし，存在しないときは0とします．ここで，自己ループ(接点iから接点iへの辺(1≦i≦n)，自分から自分への辺と考えてください)はありません．このnode&times;nodeの行列を隣接行列<em>A</em>とします．隣接行列とグラフの対応は以下の図に示す通りです．</p>\r\n\r\n<p>隣接行列<em>A</em>が与えられたとき，接点iから接点jへt回で移動できる方法の数を求めなさい．</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<p>実行例1(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#e74c3c\">5 4</span><br />\r\n<span style=\"color:#e74c3c\">0 1 0 0 0<br />\r\n1 0 1 1 0<br />\r\n0 1 0 0 1<br />\r\n0 1 0 0 1<br />\r\n0 0 1 1 0</span><br />\r\n<span style=\"color:#2980b9\">1回の移動<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 1&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 1<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 1<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 1&nbsp;&nbsp; 0<br />\r\n2回の移動<br />\r\n&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 1&nbsp;&nbsp; 1&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 3&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 2<br />\r\n&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 2&nbsp;&nbsp; 2&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 1&nbsp;&nbsp; 0&nbsp;&nbsp; 2&nbsp;&nbsp; 2&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 2&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 2<br />\r\n3回の移動<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 3&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 2<br />\r\n&nbsp;&nbsp; 3&nbsp;&nbsp; 0&nbsp;&nbsp; 5&nbsp;&nbsp; 5&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 5&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 4<br />\r\n&nbsp;&nbsp; 0&nbsp;&nbsp; 5&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 4<br />\r\n&nbsp;&nbsp; 2&nbsp;&nbsp; 0&nbsp;&nbsp; 4&nbsp;&nbsp; 4&nbsp;&nbsp; 0<br />\r\n4回の移動<br />\r\n&nbsp;&nbsp; 3&nbsp;&nbsp; 0&nbsp;&nbsp; 5&nbsp;&nbsp; 5&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp; 13&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp; 10<br />\r\n&nbsp;&nbsp; 5&nbsp;&nbsp; 0&nbsp;&nbsp; 9&nbsp;&nbsp; 9&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 5&nbsp;&nbsp; 0&nbsp;&nbsp; 9&nbsp;&nbsp; 9&nbsp;&nbsp; 0<br />\r\n&nbsp;&nbsp; 0&nbsp; 10&nbsp;&nbsp; 0&nbsp;&nbsp; 0&nbsp;&nbsp; 8</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\n\r\nint main(void){\r\n	\r\n	int a[NUM][NUM];	//隣接行列\r\n	int b[NUM][NUM];	//1つ前の経路数\r\n	int c[NUM][NUM];	//計算結果を保存するための行列\r\n	int i,j,k,m,w,e;\r\n	int t;	//移動回数\r\n	int node;	//節点数\r\n	\r\n	\r\n	scanf(\"%d %d\",&node,&t);\r\n	\r\n	//隣接行列を入力\r\n	for(i = 0; i < node; i = i + 1) {\r\n		for(j = 0; j < node; j = j + 1) {\r\n			scanf(\"%d\", &a[i][j]);\r\n		}\r\n	}\r\n	\r\n	//単位行列\r\n	for(i = 0; i < node; i = i + 1) {\r\n		for(j = 0; j < node; j = j + 1) {\r\n			b[i][j] = 0;\r\n			if(i == j) {\r\n				b[i][j] = 1;\r\n			}\r\n		}\r\n	}\r\n		\r\n	for(m = 0; m < t; m = m + 1) {\r\n		for(i = 0; i < node; i = i + 1) {\r\n			for(j = 0; j < node; j = j + 1) {\r\n				w = #!!@blank@;\r\n				for(k = 0; k < node; k = k + 1) {\r\n					e = #!!@blank@#!!@blank@#!!@blank@;\r\n					w = #!!@blank@;\r\n				}\r\n				c[i][j] = w;\r\n			}\r\n		}\r\n		\r\n		for(i = 0; i < node; i = i + 1) {\r\n			for(j = 0; j < node; j = j + 1) {\r\n				b[i][j] = c[i][j];\r\n			}\r\n		}\r\n		\r\n		printf(\"%d回の移動\\n\", m + 1);\r\n		for(i = 0; i < node; i = i + 1) {\r\n			for(j = 0; j < node; j = j + 1) {\r\n				printf(\"%4d\", c[i][j]);\r\n			}\r\n			printf(\"\\n\");\r\n		}		\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","m","i","j","t"]},{"option": ["b[i]","b[k]","b[node - i]","b[node - k]","b[node - (i + 1)]","b[node - (k + 1)]"]},{"option": ["[i] + a[i]","[j] + a[j]","[k] + a[k]","[i] * a[i]","[j] * a[j]","[k] * a[k]"]},{"option": ["[j]","[k]","[node - j]","[node - k]","[node - (j + 1)]","[node - (k + 1)]"]},{"option": ["e","e * e","w * e","w + 1","w + e","w + e * e"]}]', '["0","b[i]","[k] * a[k]","[j]","w + e"]', '場所（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(242, '<p>隣接行列<em>A</em>が与えられたとき，接点iから接点jへ移動する場合，必ず中間点point(中間点は最大5個)を通る場合の移動方法の数を求めます．</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<hr />\r\n<p>実行例1(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">節点数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">5</span><br />\r\n<span style=\"color:#2980b9\">出発点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">2</span><br />\r\n<span style=\"color:#2980b9\">中間点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">3 0</span><br />\r\n<span style=\"color:#2980b9\">到着点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">2</span><br />\r\n<span style=\"color:#2980b9\">1回目の移動回数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">3</span><br />\r\n<span style=\"color:#2980b9\">2回目の移動回数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">1</span><br />\r\n<span style=\"color:#2980b9\">隣接行列を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">0 1 0 0 0<br />\r\n1 0 1 1 0<br />\r\n0 1 0 0 1<br />\r\n0 1 0 0 1<br />\r\n0 0 1 1 0</span><br />\r\n<span style=\"color:#2980b9\">5通り</span></p>\r\n\r\n<hr />\r\n<p>実行例2(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#2980b9\">節点数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">5</span><br />\r\n<span style=\"color:#2980b9\">出発点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">2</span><br />\r\n<span style=\"color:#2980b9\">中間点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">3 1 0</span><br />\r\n<span style=\"color:#2980b9\">到着点を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">5</span><br />\r\n<span style=\"color:#2980b9\">1回目の移動回数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">5</span><br />\r\n<span style=\"color:#2980b9\">2回目の移動回数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">4</span><br />\r\n<span style=\"color:#2980b9\">3回目の移動回数を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">5</span><br />\r\n<span style=\"color:#2980b9\">隣接行列を入力してください:</span><br />\r\n<span style=\"color:#e74c3c\">0 1 0 0 0<br />\r\n1 0 1 1 0<br />\r\n0 1 0 0 1<br />\r\n0 1 0 0 1<br />\r\n0 0 1 1 0</span><br />\r\n<span style=\"color:#2980b9\">1150通り</span></p>\r\n', 'C', '#include<stdio.h>\r\n#define NUM 10\r\n\r\nint main(void) {\r\n	\r\n	int a[NUM][NUM]; //隣接行列\r\n	int b[NUM][NUM]; //１つ前の経路数\r\n	int c[NUM][NUM]; //計算結果を保存するための行列\r\n	int i, j, k, m, w, e, n, p, q;\r\n	int t[NUM];	//移動回数\r\n	int node;	//節点数\r\n	int s; //中間点の数\r\n	int point[5];	//中間点を保存するための配列\r\n	int sum = 1;\r\n	\r\n	printf(\"節点数を入力してください:\\n\");\r\n	scanf(\"%d\", &node);\r\n\r\n	printf(\"出発点を入力してください:\\n\");\r\n	scanf(\"%d\", &point[0]);\r\n	\r\n	printf(\"中間点を入力してください:\\n\");\r\n	for(s = 1; s <= 4; s = s + 1) {\r\n		scanf(\"%d\", &point[s]);\r\n		if(point[s] == 0){\r\n			break;\r\n		}\r\n	}\r\n	\r\n	printf(\"到着点を入力してください:\\n\");\r\n	scanf(\"%d\", &point[s]);\r\n\r\n	for(i = 0; i <= s - 1; i = i + 1) {\r\n		printf(\"%d回目の移動回数を入力してください:\\n\", i + 1);\r\n		scanf(\"%d\", &t[i]);\r\n	}\r\n	\r\n	printf(\"隣接行列を入力してください:\\n\");\r\n	for(i = 0; i < node; i = i + 1) {\r\n		for(j = 0; j < node; j = j + 1) {\r\n			scanf(\"%d\", &a[i][j]);\r\n		}\r\n	}\r\n	\r\n	for(n = 0; n <= s - 1; n = n + 1) {\r\n		\r\n		for(i = 0; i < node; i = i + 1) {\r\n			for(j = 0; j < node; j = j + 1) {\r\n				b[i][j] = 0;\r\n				if(i == j) {\r\n					b[i][j] = 1;\r\n				}\r\n			}\r\n		}\r\n		\r\n		for(m = 0; m < t[n]; m = m + 1) {\r\n			for(i = 0; i < node; i = i + 1) {\r\n				for(j = 0; j < node; j = j + 1) {\r\n					w = #!!@blank@;\r\n					for(k = 0; k < node; k = k + 1) {\r\n						e = #!!@blank@#!!@blank@#!!@blank@;\r\n						w = #!!@blank@;\r\n					}\r\n				c[i][j] = w;\r\n				}\r\n			}\r\n			for(i = 0; i < node; i = i + 1) {\r\n				for(j = 0; j < node; j = j + 1) {\r\n					b[i][j] = c[i][j];\r\n				}\r\n			}			\r\n		}\r\n		\r\n		p = point[#!!@blank@];\r\n		q = point[#!!@blank@];\r\n		sum = sum * b[#!!@blank@][#!!@blank@];\r\n		\r\n	}\r\n\r\n	printf(\"%d通り\\n\", sum);\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","m","i","j","t"]},{"option": ["b[i]","b[k]","b[node - i]","b[node - k]","b[node - (i + 1)]","b[node - (k + 1)]"]},{"option": ["[i] + a[i]","[j] + a[j]","[k] + a[k]","[i] * a[i]","[j] * a[j]","[k] * a[k]"]},{"option": ["[j]","[k]","[node - j]","[node - k]","[node - (j + 1)]","[node - (k + 1)]"]},{"option": ["e","e * e","w * e","w + 1","w + e","w + e * e"]},{"option": ["n","e","w","e + w","e * w","w * w"]},{"option": ["n","e","w","p","n + 1","c[i][j]"]},{"option": ["p","p - 1","q","q + 1","p + q","w"]},{"option": ["p","p + 1","q","q - 1","p + q","w"]}]', '["0","b[i]","[k] * a[k]","[j]","w + e","n","n + 1","p - 1","q - 1"]', '場所（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(243, '<p>n個の接点からなる無向グラフが与えられます．無向グラフは，接点の集合と接点と接点とを結ぶ辺の集合から構成されます．接点iから接点jへの辺が存在するとき，その距離dを配列a[i][j]の値とし，存在しないときは，計算上の都合で，とても大きな値を要素a[i][j]の値とします．なお，自己ループはありません．このn&times;nの行列を距離行列<em>A</em>とします．このとき，距離行列が与えられたとき，接点iから接点jへの最短距離を求めるアルゴリズムを考えます．</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<hr />\r\n<p>実行例1(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#e74c3c\">5 4<br />\r\n0 3 0 0 0<br />\r\n3 0 15 6 0<br />\r\n0 15 0 0 2<br />\r\n0 6 0 0 4<br />\r\n0 0 2 4 0</span><br />\r\n<span style=\"color:#2980b9\">移動回数1 以下の最短距離<br />\r\n6 3 18 9 9999<br />\r\n3 6 15 6 10<br />\r\n18 15 4 6 2<br />\r\n9 6 6 8 4<br />\r\n9999 10 2 4 4<br />\r\n移動回数2 以下の最短距離<br />\r\n6 3 18 9 13<br />\r\n3 6 12 6 10<br />\r\n18 12 4 6 2<br />\r\n9 6 6 8 4<br />\r\n13 10 2 4 4<br />\r\n移動回数3 以下の最短距離<br />\r\n6 3 15 9 13<br />\r\n3 6 12 6 10<br />\r\n15 12 4 6 2<br />\r\n9 6 6 8 4<br />\r\n13 10 2 4 4<br />\r\n移動回数4 以下の最短距離<br />\r\n6 3 15 9 13<br />\r\n3 6 12 6 10<br />\r\n15 12 4 6 2<br />\r\n9 6 6 8 4<br />\r\n13 10 2 4 4</span></p>\r\n', 'C', '#include <stdio.h>\r\n#define NUM 10\r\n#define DMAX 9999\r\n\r\nint main(void) {\r\n	int a[NUM][NUM]; /* 隣接行列 */\r\n	int b[NUM][NUM]; /* 一つ前の経路数 */\r\n	int c[NUM][NUM]; /* 計算結果を保存するための行列 */\r\n	int i, j, k, m, w;\r\n	int t; /* 移動回数 */\r\n	int n; /* 節点数 */\r\n	\r\n	scanf(\"%d %d\", &n, &t);\r\n	for(i = 0; i < n; i = i + 1) {\r\n		for(j = 0; j < n; j = j + 1) {\r\n			scanf(\"%d\", &a[i][j]);\r\n			if(a[i][j] == 0) {\r\n				a[i][j] = DMAX;\r\n			}\r\n			b[i][j] = a[i][j];\r\n		}\r\n	}\r\n	\r\n	for(m = 0; m < t; m = m + 1) {\r\n		for(i = 0; i < n; i = i + 1) {\r\n			for(j = 0; j < n; j = j + 1) {\r\n				w = #!!@blank@;\r\n				for(k = 0; k < n; k = k + 1) {\r\n					if(#!!@blank@#!!@blank@#!!@blank@ < w) { \r\n						w = #!!@blank@#!!@blank@#!!@blank@; \r\n					}\r\n				}\r\n				c[i][j] = w;\r\n			}\r\n		}\r\n		for(i = 0; i < n; i = i + 1) {\r\n			for(j = 0; j < n; j = j + 1) { \r\n				b[i][j] = c[i][j]; \r\n			}\r\n		}\r\n		printf(\"移動回数%d以下の最短距離\\n\", m + 1);\r\n		for(i = 0; i < n; i = i + 1) {\r\n			for(j = 0; j < n; j = j + 1) { \r\n				printf(\"%5d\", b[i][j]); \r\n			}\r\n			printf(\"\\n\");\r\n		}\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","i","j","b[i][j]","w + 1"]},{"option": ["b[i]","b[k]","b[node - i]","b[node - k]","b[node - (i + 1)]","b[node - (k + 1)]"]},{"option": ["[i] + a[i]","[j] + a[j]","[k] + a[k]","[i] * a[i]","[j] * a[j]","[k] * a[k]"]},{"option": ["[j]","[k]","[node - j]","[node - k]","[node - (j + 1)]","[node - (k + 1)]"]},{"option": ["b[i]","b[k]","b[node - i]","b[node - k]","b[node - (i + 1)]","b[node - (k + 1)]"]},{"option": ["[i] + a[i]","[j] + a[j]","[k] + a[k]","[i] * a[i]","[j] * a[j]","[k] * a[k]"]},{"option": ["[j]","[k]","[node - j]","[node - k]","[node - (j + 1)]","[node - (k + 1)]"]}]', '["b[i][j]","b[i]","[k] + a[k]","[j]","b[i]","[k] + a[k]","[j]"]', '場所（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(244, '<p>接点の数nと距離行列<em>A</em>を入力したのち，ある接点jを入力したら，経路が存在する場合，接点nから接点jまでの最短距離と経路を表示できるようにします．</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<hr />\r\n<p>実行例1(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#e74c3c\">5<br />\r\n0 4 3 0 0<br />\r\n4 0 2 2 0<br />\r\n3 2 0 0 6<br />\r\n0 2 0 0 4<br />\r\n0 0 6 4 0<br />\r\n9999 9999 9999 9999 0<br />\r\n9999 9999 6 4 0<br />\r\n9 6 6 4 0<br />\r\n9 6 6 4 0</span><br />\r\n<span style=\"color:#2980b9\">接点5から接点 jまでの最短距離を求めます<br />\r\njを入力してください</span><br />\r\n<span style=\"color:#e74c3c\">2</span><br />\r\n<span style=\"color:#2980b9\">接点5までの最短距離は6です<br />\r\n経路は<br />\r\n5&rarr;4&rarr;2です。</span></p>\r\n\r\n<hr />\r\n<p>実行例2(入力を<span style=\"color:#e74c3c\">赤</span>，出力を<span style=\"color:#2980b9\">青</span>で示す)</p>\r\n\r\n<p><span style=\"color:#e74c3c\">5<br />\r\n0 2 0 1 0<br />\r\n2 0 0 0 4<br />\r\n0 0 0 3 12<br />\r\n1 0 3 0 0<br />\r\n0 4 12 0 0</span><br />\r\n<span style=\"color:#2980b9\">9999 9999 9999 9999 0<br />\r\n9999 4 12 9999 0<br />\r\n6 4 12 15 0<br />\r\n6 4 12 7 0<br />\r\n6 4 10 7 0<br />\r\n6 4 10 7 0<br />\r\n接点5から接点jまでの最短距離を求めます<br />\r\njを入力してください</span><br />\r\n<span style=\"color:#e74c3c\">3</span><br />\r\n<span style=\"color:#2980b9\">接点5から接点3までの 最短距離は10です<br />\r\n経路は<br />\r\n5&rarr;2&rarr;1&rarr;4&rarr;3です。</span></p>\r\n', 'C', '#include <stdio.h>\r\n#define NUM 99\r\n#define DMAX 9999\r\n\r\nint main(void) {\r\n	int a[NUM], b[NUM];\r\n	int i, j, n, w;\r\n	int t[NUM][NUM];\r\n	int goal_node;\r\n	int start_node;\r\n	scanf(\"%d\", &n);\r\n	goal_node = n;\r\n\r\n	for(i = 0; i < n; i = i + 1) {\r\n		for(j = 0; j < n; j = j + 1) {\r\n			scanf(\"%d\", &t[i][j]);\r\n			if(t[i][j] == 0) {\r\n				t[i][j] = DMAX;\r\n			}\r\n		}\r\n	}\r\n	for(i = 0; i < n; i = i + 1) {\r\n		a[i] = DMAX;\r\n	}\r\n	a[n - 1] = 0;\r\n	for(j = 0; j < n; j = j + 1) {\r\n		printf(\"%d\\t\", a[j]);\r\n	}\r\n	printf(\"\\n\\");\r\n	while(1) {\r\n		for(i = 0; i < n; i = i + 1) {\r\n			b[i] = a[i];\r\n			for(j = 0; j < n; j = j + 1) {\r\n				w = #!!@blank@;\r\n				if(#!!@blank@) {\r\n					b[i] = w;\r\n				}\r\n			}\r\n		}\r\n		for(i = 0; i < n; i = i + 1) {\r\n			if(#!!@blank@) { \r\n				break; \r\n			}\r\n		}\r\n		for(j = 0; j < n; j = j + 1) {\r\n			printf(\"%d\\t\", b[j]);\r\n		}\r\n		printf(\"\\n\\");\r\n		if(#!!@blank@) {\r\n			break;\r\n		}\r\n		for(j = 0; j < n; j = j + 1) {\r\n			a[j] = b[j];\r\n		}\r\n	}\r\n\r\n	start_node = goal_node;\r\n\r\n	printf(\"接点%dから接点jまでの最短距離を求めます\\n\", start_node);\r\n	printf(\"jを入力してください\\n\\");\r\n	scanf(\"%d\", &goal_node);\r\n	if(a[goal_node - 1] != DMAX) {\r\n		printf(\"接点%dまでの最短距離は%dです\\n\", start_node, a[goal_node-1]);\r\n\r\n		//逆順に経路を求めていく\r\n    \r\n		int d[NUM];\r\n\r\n		start_node = start_node - 1;\r\n		goal_node = goal_node - 1;\r\n\r\n		int from, to;\r\n\r\n		from = goal_node;\r\n\r\n\r\n		d[0] = goal_node + 1;\r\n		for(i = 1; i < n; i = i + 1){\r\n			for (to = 0; to < n; to = to + 1){\r\n				if(a[from] - t[from][to] == a[to]) {\r\n					d[i] = #!!@blank@;\r\n					from = to;\r\n					break;\r\n				}\r\n			}\r\n			if(#!!@blank@) { \r\n				break;\r\n			}\r\n		}\r\n		d[i] = #!!@blank@;\r\n\r\n		printf(\"経路は\\");\r\n		while(i > 0) {\r\n			printf(\"%d→\", d[i]);\r\n			i = i - 1;\r\n		}\r\n		printf(\"%dです。\\n\", d[0]);\r\n	} else {\r\n		printf(\"接点%dまでの経路はありません\\n\", start_node);\r\n	}\r\n\r\n\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a[i]","a[j]","t[i][j]","t[i][j] + a[i]","t[i][j] + a[j]","w + 1"]},{"option": ["w < b[i]","w < b[j]","w > b[i]","w > b[j]","w < t[i][j]","w > t[i][j]"]},{"option": ["a[i] == b[i]","a[i] != b[i]","a[i] <= b[i]","a[i] >= b[i]","a[i] == DMAX","b[i] == DMAX"]},{"option": ["i > j","i < j","i > n","i < n","i == n","j != n"]},{"option": ["i","from","to + 1","d[i] + 1","a[to]","a[from]"]},{"option": ["from == to","from != to","from == start_node","from != start_node","from == goal_node","from != goal_node"]},{"option": ["from","start_node","start_node + 1","d[i] + 1","goal_node + 1","goal_node"]}]', '["t[i][j] + a[j]","w < b[i]","a[i] != b[i]","i == n","to + 1","from == start_node","start_node + 1"]', '場所（不正解）'),
(275, '<p>aaa</p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main(void)\r\n{\r\n  int num1,num2,num3;\r\n  num1=9;\r\n  num2=3;\r\n  num3=#!!@blank@;\r\n  printf(\"%d\\n\",num3*num2);\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["3","4","5"]}]', '["5"]', '数（不正解）'),
(276, '<p>bbb</p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main(void)\r\n{\r\n  int num1,num2,num3;\r\n  num1=9;\r\n  num2=3;\r\n  num3=#!!@blank@;\r\n  printf(\"%d\\n\",num3*num2);\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["5","6"]}]', '["5"]', '数（不正解）'),
(277, '<p>出力例と同じ出力になる選択肢を選べ</p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main(void)\r\n{\r\n  int num1,num2,num3,num4;\r\n  num1=9;\r\n  num2=3;\r\n  num3=num1-num2;\r\n  num4=num3*num2;\r\n  printf(\"#!!@blank@\\n\",#!!@blank@);\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["%s","%d","%c","%o"]},{"option": ["num1","num2","num3","num4"]}]', '["%d","num3"]', '数（不正解）'),
(278, '<p>下記の出力例となるように虫食いを埋めてください</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'C', '#!!@blank@\r\n\r\nint main(void)\r\n{\r\n    #!!@blank@\r\n    #!!@blank@\r\n    \r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["include <studio.h>","include <stdio.h>","#include <studio.h>","#include <stdio.h>"]},{"option": ["printf(\"hello \");","printf(hello );","printf(\"hello\\n\");","printf(\"hello\", \\n);"]},{"option": ["printf(\"world!!\");","printf(world!! );","printf(\"world!!\\n\");","printf(\"world!!\", \\n);"]}]', '["#include <stdio.h>","printf(\"hello \");","printf(\"world!!\");"]', '数（不正解）'),
(279, '<p>出力例と同じになるように選択肢を選びなさい</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>出力例<br />\r\n&nbsp;hello world!!</p>\r\n', 'C', '#!!@blank@\r\n\r\nint main(void)\r\n{\r\n    #!!@blank@\r\n    #!!@blank@\r\n    \r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": [""]}]', '[""]', '数（不正解）'),
