(341, '<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">下記の出力結果と同じになるように選択肢を選びなさい</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">入出力例</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n\r\n    int a=24,b=13,c,d,e;\r\n    \r\n    c=a;\r\n    a=#!!@blank@;\r\n    b=c;\r\n\r\n    d=#!!@blank@;\r\n    e=#!!@blank@;\r\n    \r\n    printf(\"%d,%d,%d,%d,%d\\n\",a,b,c,d,e);\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","b","c","d"]},{"option": ["a+c/b*b-1","a+c*b/(b+1)","c+a*b/b-1","a+c*b/b+1"]},{"option": ["a*(a-b)/a+b%2","a*a-b/(a+b)%2","a*b-a/a+b%2","a/(a-b)*a+b%2"]}]', '["b","a+c*b/b+1","a*(a-b)/a+b%2"]', '数（不正解）');
