(342, '<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">以下の計算式を参考にして，</span></span><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">下記の出力結果と同じになるように選択肢を選びなさい</p><p><img src=\"data:image/png;base64,\" /></p>\r\n<p>入出力例</p>\r\n<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    double h,w,ws,hi,bmi;\r\n    \r\n    printf(\"身長は？[m]:\");\r\n    scanf(\"%lf\",&h);\r\n    printf(\"体重は？[kg]\");\r\n    scanf(\"%lf\",&w);\r\n    \r\n    #!!@blank@;\r\n    #!!@blank@;\r\n    #!!@blank@;\r\n    \r\n    printf(\"標準体重は%0.1lf[kg]\\n\",ws);\r\n    printf(\"肥満度は%0.1lf[%%]\\n\",hi);\r\n    printf(\"BMIは%0.1lf\\n\",bmi);\r\n\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["ws=h*h*22","ws=2*(h)*22","ws=(h*2)*22","ws=2(h)*22"]},{"option": ["bmi=w-ws/ws*100","hi=(w-ws)/ws*100","bmi=(w-ws)/ws*100","ws=(w-ws)/ws*100"]},{"option": ["bmi=w/(h*2)","ws=w/h*2","bmi=w/h*h","bmi=w/(h*h)"]}]', '["ws=h*h*22","hi=(w-ws)/ws*100","bmi=w/(h*h)"]', '数（不正解）');
