(343, '<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">この問題は商品の値段・個数と税率を入力すると商品の合計と税込価格が出力するプログラムである。</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">下記の出力結果と同じになるように選択肢を選びなさい</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">例　税率8％時に120円の商品１を7個と150円の商品２を3個を買った場合</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c,d,f,h,i;\r\n    double e;\r\n    printf(\"商品１の値段と個数を入力してください:\");\r\n    scanf(\"%d %d\",&a ,&b);\r\n    printf(\"商品２の値段と個数を入力してください:\");\r\n    scanf(\"%d %d\",&c ,&d);\r\n    printf(\"税率をきめてください[%%]\");\r\n    scanf(\"%d\",&f);\r\n    e=#!!@blank@;\r\n    h=a*b+c*d;\r\n    printf(\"合計価格%d円に%0.2lfをかけました\\n\",h,e);\r\n    printf(\"税込価格：%d円\\n\",#!!@blank@);\r\n    i=#!!@blank@;\r\n    printf(\"1円の位を切り下げ価格：%d円\\n\",i);\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["1.0+(double)f/100","1+(double)f/100","(double)(1+f)/100;","(1.0+f)/100"]},{"option": ["h*e","h*(int)e","(int)h*e","(int)(h*e)"]},{"option": ["h*e-h*e%10","h*e-(int)(h*e)%10","(int)(h*e-h*e)%10","(int)(h*e-h*e%10)"]}]', '["1.0+(double)f/100","(int)(h*e)","h*e-(int)(h*e)%10"]', '数（不正解）');
