(346, '<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">この問題は秒を時間・分・秒に変換するプログラムである。\r\n\r\n下記の出力結果と同じになるように選択肢を選びなさい。\r\nまた，時間・分・秒については，以下の一般化された数式を用いなさい\r\n換算結果＝（秒数―すでに換算済みの秒数）/求めたい単位を秒換算した値\r\nただし，公理から1時間は60分とし，１分は60秒とする。\r\n</span></span></p>\r\n<p style=\"text-align:justify\"><span style=\"font-size:10.5pt\"><span style=\"font-family:游明朝,serif\">入出力例</span></span></p>\r\n<img src=\"data:image/png;base64,\">\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int #!!@blank@;\r\n    printf(\"秒数を入力してください:\");\r\n    scanf(\"%d\",&a);\r\n    \r\n    d=60*60;\r\n    #!!@blank@;\r\n    #!!@blank@;\r\n    printf(\"%d時間\",b);\r\n    d=60;\r\n    #!!@blank@;\r\n    #!!@blank@;\r\n    printf(\"%d分\",b);\r\n    d=1;\r\n    #!!@blank@;\r\n    printf(\"%d秒\\n\",b);\r\n}\r\n', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=0,b,c,d","a,b=0,c,d","a,b,c=0,d","a,b,c,d=0"]},{"option": ["b=(c-a)/d","b=(a-c)/d","b=(c-a)","c=(d-b)/a"]},{"option": ["c=a*d","b+=b*d;","d+=a*b","c+=b*d"]},{"option": ["b=(c-a)/d","b=(a-c)/d","b=(c-a)","c=(d-b)/a"]},{"option": ["c=a*d","c+=b*d","b+=b*d","d+=a*b"]},{"option": ["b=(c-a)/d","b=(a-c)/d","b=(c-a)","c=(d-b)/a"]}]', '["a,b,c=0,d","b=(a-c)/d","c+=b*d","b=(a-c)/d","c+=b*d","b=(a-c)/d"]', '数（不正解）');
