(355, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c;\r\n    printf(\"aとbに値をいれてください:\");\r\n    scanf(\"%d %d\",&a,&b);\r\n    c=0;\r\n    if(#!!@blank@){\r\n        c+=1;\r\n        b--;\r\n    }\r\n    if(#!!@blank@){\r\n        c+=10;\r\n        b--;\r\n    }\r\n    if(#!!@blank@){\r\n        c+=100;\r\n        b--;\r\n    }\r\n    if(#!!@blank@){\r\n        c+=1000;\r\n        b--;\r\n    }\r\n    printf(\"%d %d %d\\n\" ,a,b,c);\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a!=b","a>b","a<b","a==b"]},{"option": ["a!=b","a>b","a<b","a==b"]},{"option": ["a!=b","a>b","a<b","a==b"]},{"option": ["a!=b","a>b","a<b","a==b"]}]', '["a<b","a>b","a==b","a!=b"]', '数（不正解）');
