(357, '<p>平面上においての斜辺と斜辺の対角までの長さを入力したとき、<br />\r\n直角三角形の面積を求めるプログラムです</p>\r\n\r\n<p>三角形の面積を求める公式は<br />\r\n　　面積＝斜辺の長さ&times;斜辺の対角までの長さ&times;１/２<br />\r\nただし，底辺の長さが斜辺から対角までの長さの２倍より小さい場合，<br />\r\nこの公式は成り立ちません</p>\r\n\r\n<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例<br />\r\n&nbsp;</p>\r\n\r\n<img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    float a,b,c;\r\n    printf(\"直角三角形の面積を計算します\\n\");\r\n    printf(\"斜辺の長さは:\");\r\n    scanf(\"%f\",&a);\r\n    printf(\"斜辺から対角までの長さは:\");\r\n    scanf(\"%f\",&b);\r\n    if(#!!@blank@){\r\n        #!!@blank@;\r\n        printf(\"直角三角形の面積は%fです\\n\",c);\r\n    }else{\r\n        printf(\"平面上では存在しない三角形です\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a*2>b","a*2>=b","a/2>=b","a/2>b"]},{"option": ["a*b/2","c=a*b/2","d=(a*b)/2","a*b/2"]}]', '["a/2>=b","c=a*b/2"]', '数（不正解）');
