(358, '<p>型変換をするプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例<br />\r\n&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c;\r\n    float d,e;\r\n    int f=0;\r\n    printf(\"選択してください[int型:0 float型:1]：\");\r\n    scanf(\"%d\",&a);\r\n    \r\n    if(#!!@blank@){\r\n        printf(\"整数を入力してください：\");\r\n        scanf(\"%d\",&b);\r\n        e=(float)b;\r\n        f=1;\r\n    }\r\n    if(#!!@blank@){\r\n        printf(\"実数を入力してください：\");\r\n        scanf(\"%f\",&d);\r\n        c=(int)d;\r\n        f=2;\r\n    }\r\n    if(#!!@blank@){\r\n        printf(\"[int型:0 float型:1]のどちらかを選択してください\\n\");\r\n        return 0;\r\n    }\r\n    if(#!!@blank@){\r\n        printf(\"%dを%fに型変換をしました\\n\",b,e);\r\n    }else{\r\n        printf(\"%fを%dに型変換をしました\\n\",d,c);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a==0","a!=0","a==1","a!=1"]},{"option": ["a==0","a!=0","a==1","a!=1"]},{"option": ["a!=0","a!=1","f==0","f==1"]},{"option": ["a!=0","a!=1","f==0","f==1"]}]', '["a==0","a==1","f==0","f==1"]', '数（不正解）');
