(359, '<p>３桁の整数が入力されたか判定するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b=0;\r\n    printf(\"3桁の整数を入力してください:\");\r\n    scanf(\"%d\",&a);\r\n    if(#!!@blank@){\r\n        b=1;\r\n    }\r\n    if(#!!@blank@){\r\n        b=3;\r\n    }\r\n    if(#!!@blank@){\r\n        b=2;\r\n    }\r\n    if(b==1){\r\n        printf(\"桁が足りません\\n\");\r\n    }\r\n    if(b==2){\r\n        printf(\"桁が多すぎます\\n\");\r\n    }\r\n    if(b==3){\r\n        printf(\"%dは３桁ですね\\n\",a);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a/1000==0","a/100==0","a/1000!=0","a/100!=0"]},{"option": ["a/1000==0","a/100==0","a/1000!=0","a/100!=0"]},{"option": ["a/1000==0","a/100==0","a/1000!=0","a/100!=0"]}]', '["a/100==0","a/100!=0","a/1000!=0"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(367, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include<stdio.h>\r\nint main(void){\r\n	int a,b;\r\n	double c;\r\n	printf(\"0以外の数字を２つ入力してください:\");\r\n	scanf(\"%d %d\",&a,&b);\r\n	\r\n	if(a #!!@blank@ 0 #!!@blank@ b #!!@blank@ 0){\r\n		printf(\"0以外の数字でお願いします\\n\");\r\n    		return 0;\r\n	}else{\r\n		c=(double)b/a+(double)a/b;\r\n	}\r\n    printf(\"%lf\\n\",c);\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["!=","==","&&","||"]},{"option": ["!=","==","&&","||"]},{"option": ["!=","==","&&","||"]}]', '["==","||","=="]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(368, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入力した数値を絶対値（０からの距離）にして大きさを比較するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include<stdio.h>\r\nint main(void){\r\n	int a,b;\r\n	printf(\"絶対値を比較しましょう\\n\");\r\n	printf(\"変数aに0以外の数字を格納してください:\");\r\n	scanf(\"%d\",&a);\r\n	printf(\"変数bに0以外の数字を格納してください:\");\r\n	scanf(\"%d\",&b);	\r\n    if(#!!@blank@){\r\n        printf(\"0以外の数字でお願いします\\n\");\r\n        return 0;\r\n    }	\r\n    if(#!!@blank@){\r\n        if(#!!@blank@){\r\n            b=b*-1;\r\n        }\r\n    }else{\r\n        a=a*-1;\r\n        if(b<0){\r\n            b=b*-1;\r\n        }\r\n	}\r\n	if(a>b){\r\n	    printf(\"aのほうが大きい\\n\");\r\n	}else{\r\n	    printf(\"bのほうが大きい\\n\");\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a==0 && b==0","a!=0 || b!==0","a*b==0","a==b==0"]},{"option": ["a>0","a<0","b>0","b<0"]},{"option": ["a>0","a<0","b>0","b<0"]}]', '["a*b==0","a>0","b<0"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(369, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;Arial Unicode MS&quot;\">四則演算</span><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">の中から一つ選択して，計算するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main()\r\n{\r\n    int a,b,c,d;\r\n    printf(\"四則演算の中から選んだでください\\n\");\r\n    printf(\"1:足し算,2:引き算,3:掛け算,4:割り算\\n\");\r\n    scanf(\"%d\",&a);\r\n    printf(\"２つの数字を入力してください:\");\r\n    scanf(\"%d %d\",&b,&c);\r\n    if(#!!@blank@ #!!@blank@ #!!@blank@){//a<1 、||、 4<aの３問\r\n        printf(\"1,2,3,4,のどれかを選んでください\\n\");\r\n    }else{\r\n        switch(a){\r\n            case 1:\r\n                #!!@blank@;\r\n                break;\r\n            case 2:\r\n                #!!@blank@;\r\n                break;\r\n            case 3:\r\n                #!!@blank@;\r\n                break;\r\n            case 4:\r\n                #!!@blank@;\r\n                break;\r\n        }\r\n        printf(\"計算結果:%d\\n\",d);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a<1","a<=1","a>1","a>=1"]},{"option": [" ==","!=","||","&&"]},{"option": ["a<4","a<=4","a>4","a>=4"]},{"option": ["d=b*c","d=b/c","d=b-c","d=b+c"]},{"option": ["d=b*c","d=b/c","d=b-c","d=b+c"]},{"option": ["d=b*c","d=b/c","d=b-c","d=b+c"]},{"option": ["d=b*c","d=b/c","d=b-c","d=b+c"]}]', '["a<1","||","a>4","d=b+c","d=b-c","d=b*c","d=b/c"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(370, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">年齢と身長制限（下限上限）のあるアトラクションで入場できるか判断するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p><p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p><p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c,d,e;\r\n    printf(\"年齢制限[才]:\");\r\n    scanf(\"%d\",&a);\r\n    printf(\"身長制限[cm]:\");\r\n    scanf(\"%d %d\",&c,&d);\r\n    printf(\"%d才になっていない方、または%dcm未満%dcm超の方はご入場できません\\n\",a,c,d);\r\n    printf(\"あなたの年齢は？\");\r\n    scanf(\"%d\",&b);\r\n    printf(\"あなたの身長[cm]は？\");\r\n    scanf(\"%d\",&e);\r\n    \r\n    if(#!!@blank@){\r\n        if(#!!@blank@ && #!!@blank@){\r\n            printf(\"どうぞ楽しんで\\n\");\r\n        }else{\r\n            printf(\"申し訳ございません\\n\");\r\n        }\r\n    }else{\r\n        printf(\"申し訳ございません\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a>b","a<b","a>=b","a<=b"]},{"option": ["e<c","c<=d","c<=e","e<=c"]},{"option": ["e<=c","d<e","d<=e","e<=d"]}]', '["a<=b","c<=e","e<=d"]', '数（不正解）');
