(371, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">下記の西暦と元号の関係の表と下記の出力結果を参考に選択肢を選びなさい<br />\r\n（※実際の西暦と元号の関係とは多少異なります）</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p>\r\n\r\n<p>&nbsp;<img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main()\r\n{\r\n    int year;\r\n    printf(\"西暦を入力してください:\");\r\n    scanf(\"%d\",&year);\r\n\r\n    if (#!!@blank@) {\r\n        printf(\"令和\\n\");\r\n    }else if(#!!@blank@){\r\n        printf(\"平成\\n\");\r\n    }else if(#!!@blank@){\r\n        printf(\"昭和\\n\");\r\n    }else if(#!!@blank@){\r\n        printf(\"大正\\n\");\r\n    }else{\r\n        printf(\"自分で調べてください\\n\");\r\n    } \r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["year <= 1912","year >= 1912","year <= 2020","year >= 2020"]},{"option": [" year <= 1989","year >= 1989","year <= 1926"," year >= 1926"]},{"option": ["year <= 1989"," year >= 1989","year <= 1926","year >= 1926"]},{"option": ["year <= 1912","year >= 1912"," year <= 2020","year >= 2020"]}]', '["year >= 2020"," year >= 1926"," year >= 1989","year >= 1912"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(372, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">うるう年を判定するプログラムです<br />\r\nうるう年の条件は以下となっている<br />\r\n・西暦年が4で割り切れる年はうるう年<br />\r\n・ただし、西暦年が100で割り切れる年は平年<br />\r\n・ただし、西暦年が400で割り切れる年はうるう年</span></p>\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main()\r\n{\r\n    int year;\r\n    printf(\"西暦を入力してください:\");\r\n    scanf(\"%d\",&year);\r\n    if (#!!@blank@) {\r\n        if (#!!@blank@) {\r\n            if (#!!@blank@) {\r\n                printf(\"うるう年です\\n\");\r\n            } else {\r\n                printf(\"うるう年ではありません\\n\");\r\n            }\r\n        } else {\r\n            printf(\"うるう年です\\n\");\r\n        }\r\n    } else {\r\n        printf(\"うるう年ではありません\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["year % 400 == 0","year % 400 != 0","year % 4 == 0","year % 4 != 0"]},{"option": ["year % 100 == 0","year % 100 != 0","year % 4 == 0","year % 4 != 0"]},{"option": ["year % 100 == 0","year % 100 != 0","year % 400 == 0","year % 400 != 0"]}]', '["year % 4 == 0","year % 100 == 0","year % 400 == 0"]', '数（不正解）');
