(374, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">うるう年を判定するプログラムです<br />\r\nうるう年の条件は以下となっている<br />\r\n・西暦年が4で割り切れる年はうるう年<br />\r\n・ただし、西暦年が100で割り切れる年は平年<br />\r\n・ただし、西暦年が400で割り切れる年はうるう年</span></p>\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p><p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main()\r\n{\r\n    int year;\r\n    printf(\"西暦を入力してください:\");\r\n    scanf(\"%d\",&year);\r\n\r\n    if( (year%4#!!@blank@ 0 #!!@blank@ year%100 #!!@blank@ 0) #!!@blank@ year%400 #!!@blank@ 0){\r\n        printf(\"うるう年です\\n\");\r\n    }else{\r\n        printf(\"うるう年ではありません\\n\");\r\n        \r\n    }\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["&&","||","!=","=="]},{"option": ["&&","||","!=","=="]},{"option": ["&&","||","!="," =="]},{"option": ["&&","||","!=","=="]},{"option": ["&&","||","!=","=="]}]', '["==","&&","!=","||","=="]', '数（不正解）');
