(375, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入力された３つの値を比べ，一番大きい値を判定するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial,sans-serif\"><span style=\"font-family:&quot;ＭＳ 明朝&quot;,serif\">入出力例</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,', 'C', '#include<stdio.h>\r\nint main(void){\r\n	int a,b,c,d;\r\n	printf(\"最大値を探しましょう\\n\");\r\n	printf(\"aとbとcの値を入力:\");\r\n	\r\n	scanf(\"%d %d %d\",&a,&b,&c);\r\n	if(#!!@blank@){\r\n		printf(\"数字がかぶっています\\n\");\r\n		return 0;\r\n	}\r\n	if(#!!@blank@){\r\n		if(#!!@blank@){\r\n			d=a;\r\n		}else{\r\n			d=c;\r\n		}\r\n	}else if(b > c){\r\n		d=b;\r\n	}else{\r\n		d=c;\r\n	}\r\n	printf(\"最大値は%d\\n\",d);\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a==b && b==c && a==c"," a==b || b==c || a==c","a!=b && b!=c && a!=c","a!=b || b!=c || a!=c"]},{"option": ["c < a","c > a ","a > b","a < b"]},{"option": ["c < a","c > a","a > b","a < b"]}]', '[" a==b || b==c || a==c","a > b","c < a"]', '数（不正解）');
