(396, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b;\r\n    \r\n    #!!@blank@;\r\n    while(#!!@blank@){\r\n        printf(\"%d \",a);\r\n        #!!@blank@;\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=0","a=1","a=-1","a=10"]},{"option": ["a<0","a>0","a<10","a>10"]},{"option": ["a=a--","a=a++","a--","a++"]}]', '["a=0","a<10","a++"]', '数（不正解）'),
(397, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例<br />\r\n<img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a;\r\n    \r\n    #!!@blank@;\r\n    while(#!!@blank@){\r\n        printf(\"%d \",a);\r\n        #!!@blank@;\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=0","a=1","a=-1","a=10"]},{"option": ["a<=0","a>=0","a<10","a<10"]},{"option": ["a=a--","a=a++","a--","a++"]}]', '["a=10","a>=0","a--"]', '数（不正解）'),
(398, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b;\r\n    scanf(\"%d\",&a);\r\n    for(#!!@blank@;#!!@blank@;#!!@blank@){\r\n        printf(\"%d \",b);\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b=a","a=b","b=0","a=0"]},{"option": ["b<=a","a<=b","b>0","a<b"]},{"option": ["a=1","b=1","b++","b--"]}]', '["b=0","b<=a","b++"]', '数（不正解）'),
(399, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b;\r\n    scanf(\"%d\",&a);\r\n    for(#!!@blank@;#!!@blank@;#!!@blank@){\r\n        printf(\"%d \",b);\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b=a","a=b","b=0","a=0"]},{"option": ["b<=a","a<=b","b>0","a<b"]},{"option": ["a=1","b=1","b++","b--"]}]', '["b=a","b>0","b--"]', '数（不正解）');
