(400, '<p>入力した整数の桁を調べるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b;\r\n    b=0;\r\n    scanf(\"%d\",&a);\r\n    while(a #!!@blank@ 0){\r\n        #!!@blank@;\r\n        #!!@blank@;\r\n    }\r\n    printf(\"入力した整数は%d桁です\\n\",b);\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["%10=","==","!=","/10="]},{"option": ["a=a%10","a=a/10","b=b/10","b=a/10"]},{"option": ["a=1","b=1","b++","b--"]}]', '["!=","a=a/10","b++"]', '数（不正解）'),
(401, '<p>約数の個数を求めるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例<br />\r\n<img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c;\r\n    #!!@blank@;\r\n    scanf(\"%d\",&a);\r\n    printf(\"%dの約数は\",a);\r\n\r\n    for(#!!@blank@;b<=a;#!!@blank@) {\r\n        if (#!!@blank@ == 0){\r\n            printf(\"%d \", b);\r\n            c++;\r\n        }\r\n    }\r\n  printf(\"の計%d個です\\n\", c);\r\n\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b=0","c=0","a=0","d=0"]},{"option": ["b=0","a=1","b=1","b=0"]},{"option": ["a++","b++","c++","d++"]},{"option": ["a/b","b/a","a % b","b%a"]}]', '["c=0","b=1","b++","a % b"]', '数（不正解）'),
(402, '<p>０から100の入力した数値の倍数の個数・合計を求めるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c,d;\r\n   #!!@blank@;\r\n   #!!@blank@;\r\n    scanf(\"%d\",&a);\r\n    printf(\"0から100での%dの倍数は\",a);\r\n    while(b#!!@blank@ 100){\r\n        if(b%a==0){\r\n            #!!@blank@;\r\n            d=d+b;\r\n        }\r\n        #!!@blank@;\r\n    }\r\n    printf(\"%d個です\\n\",c);\r\n    printf(\"%dの倍数の合計は%d\\n\",a,d);\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=b=0","b=c=0","c=d=0","d=a=0"]},{"option": ["a=1","b=1","c=1","d=1"]},{"option": ["<",">","<=",">="]},{"option": ["a++","b++","c++","d++"]},{"option": ["a++","b++","c++","d++"]}]', '["c=d=0","b=1","<=","c++","b++"]', '数（不正解）');
