(403, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例<br />\r\n&nbsp;</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c,d;\r\n    d=0;\r\n    b=0;\r\n    scanf(\"%d\",&a);\r\n    scanf(\"%d\",&c);\r\n    while(b<=#!!@blank@){\r\n        #!!@blank@;\r\n        printf(\"＊\");\r\n        if(#!!@blank@==0){\r\n            printf(\"\\n\");\r\n            #!!@blank@;\r\n        }\r\n        #!!@blank@;\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a-1","a+1","c-1","c+a"]},{"option": ["a++","b++","c++","d++"]},{"option": ["d-a","a%d","d/a","a+d"]},{"option": ["a=0","b=0","c=0","d=0"]},{"option": ["a++","b++","c++","d++"]}]', '["c-1","d++","d-a","d=0","b++"]', '数（不正解）'),
(416, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int a,b,c,d;\r\n	scanf(\"%d %d\",&a,&b);\r\n	for(c=1;#!!@blank@;#!!@blank@)\r\n	{\r\n		for(d=1;#!!@blank@;#!!@blank@)\r\n		{\r\n		    printf(\"*\");\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c<a","c<=a","a<c","a<=c"]},{"option": ["a++","b++","c++","d++"]},{"option": ["d<=b","b<c","a<d","c<=a"]},{"option": ["a++","b++","c++","d++"]}]', '["c<=a","c++","d<=b","d++"]', '数（不正解）'),
(417, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int a,b,c,d;\r\n	scanf(\"%d\",&a);\r\n	b=#!!@blank@;\r\n	for(c=1;c<=a;c++)\r\n	{\r\n		for(d=#!!@blank@;d #!!@blank@ b;d++)\r\n		{\r\n		    printf(\"o\");\r\n		}\r\n		for(d=#!!@blank@;d #!!@blank@ b;d++)\r\n		{\r\n		    printf(\"x\");\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["1","2","a-1","a-2"]},{"option": ["b-1","c-1","b-c-1","b-(c-1)"]},{"option": ["<",">","<=",">="]},{"option": ["b-1","c-1","b-c-1","b-(c-1)"]},{"option": ["<",">","<=",">="]}]', '["a-2","b-(c-1)","<","c-1","<="]', '数（不正解）'),
(418, '<p>入力値の合計を計算するプログラムです<br />\r\n０が入力されたら合計を出力します<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a=1,b=1,c=1;\r\n    b=0;\r\n   #!!@blank@;\r\n    #!!@blank@\r\n        scanf(\"%d\",&a);\r\n        c=#!!@blank@;\r\n    #!!@blank@\r\n    \r\n    printf(\"合計は%d\\n\",c);\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=0","c=0","c=1","scanf(\"%d\",&a)"]},{"option": ["while(a!=0){","do{","while(a!=b){","while(a!=1){"]},{"option": ["a+b","c+1","c+b","c+a"]},{"option": ["}","}while(a!=1);","}while(a!=b);","};"]}]', '["c=0","do{","c+a","while(a!=b);"]', '数（不正解）');
