(420, '<p>素数を判定するプログラムです<br />\r\n素数は１とその数でしか割れない自然数です<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main()\r\n{\r\n    int a,b,c= 0;\r\n    printf(\"自然数を入力してください:\");\r\n    scanf(\"%d\", &a);\r\n    for( b=#!!@blank@;b<a;b++ ) {\r\n        if( #!!@blank@==0 ) {\r\n        c = 1;\r\n        break;\r\n        }\r\n    }\r\n    if( c==0 #!!@blank@ a #!!@blank@ a*a){\r\n        printf(\"%dは素数です。\\n\",a);\r\n    }else{\r\n        printf(\"%dは素数ではありません。\\n\",a);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["1","2","3","4"]},{"option": ["c%b","a%b","b%a","a%c"]},{"option": ["==","!=","&&","||"]},{"option": ["==","!=","&&","||"]}]', '["2","a%b","&&","!="]', '数（不正解）'),
(421, '<p>0から100までの素数を求めるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int a,b,c,d;\r\n	for(a=0;a<=100;a++)\r\n	{\r\n		c=0;\r\n		for(#!!@blank@;#!!@blank@;b++)\r\n		{\r\n			if(a%b==0){\r\n 	 	 	 	#!!@blank@;\r\n 	 	 	 }\r\n		}\r\n		if(c==#!!@blank@) printf(\"%d \",a);\r\n	}\r\n	printf(\"\\n\");\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b=0","b=1","b=2","b=3"]},{"option": ["b<a","b<=a","b<100","b<=100"]},{"option": ["a++","b++","c++","d++"]},{"option": ["0","1","2","3"]}]', '["b=1","b<=a","c++","2"]', '数（不正解）');
