(422, '<p>0から100までの素数を求めるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\nint main(void)\r\n{\r\n    int a,b,c=#!!@blank@;\r\n    for(a=c;a<=100;a++){\r\n        for(b=c;#!!@blank@;b++){\r\n            if(a%b==0){\r\n                break;\r\n            }\r\n        }\r\n        if(a #!!@blank@ b){\r\n            printf(\"%d \",a);\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","2","3"]},{"option": ["a<b","a<=b","b<a","b<=a"]},{"option": ["<=",">=","==","!="]}]', '["2","b<=a","=="]', '数（不正解）');
