(423, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int a,b,c,d,e;\r\n	printf(\"整数を入力してください\\n\");\r\n	scanf(\"%d\",&a);\r\n	printf(\"%dを言ったら負けゲーム\\n\",a);\r\n	b=0;\r\n	#!!@blank@;\r\n	while(b<=a){\r\n	    if(c==1){\r\n	        printf(\"先攻さん(1-3個まで):\");\r\n	        scanf(\"%d\",&d);\r\n	        for(e=0;#!!@blank@;e++){\r\n	            #!!@blank@;\r\n	            printf(\"%d \",b);\r\n	        }\r\n	        printf(\"\\n\");\r\n	    }else{\r\n	        printf(\"後攻さん(1-3個まで):\");\r\n	        scanf(\"%d\",&d);\r\n	        for(e=0;#!!@blank@;e++){\r\n	            #!!@blank@;\r\n	            printf(\"%d \",b);\r\n	        }\r\n	        printf(\"\\n\");\r\n	    }\r\n	    if(#!!@blank@){\r\n	        if(c==1){\r\n	            printf(\"先攻さんの負け\\n\");\r\n	        }else{\r\n	            printf(\"後攻さんの負け\\n\");\r\n	        }\r\n	        break;\r\n	    }else{\r\n	        c=#!!@blank@;\r\n	    }\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a=1","c=1","d=1","e=1"]},{"option": ["c<d","e<d","c<e","d<a"]},{"option": ["e++","c++","b++","a++"]},{"option": ["c<d","e<d","c<e","d<a"]},{"option": ["e++","c++","b++","a++"]},{"option": ["b>=a","e>=b","c>=a","c>a"]},{"option": ["b*-1","c+1","a+1","c*-1"]}]', '["c=1","e<d","b++","e<d","b++","b>=a","c*-1"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(424, '<p>下記の出力結果から法則を導きだし，同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a=10,b,c,d;\r\n    scanf(\"%d\",&c);\r\n    for(a=1;a<#!!@blank@;a++){\r\n        d=a%4;\r\n        if(#!!@blank@==0){\r\n            if(#!!@blank@==0){\r\n                printf(\"4\");\r\n            }else{\r\n                printf(\"〇\");\r\n            }\r\n        }else{\r\n            printf(\"×\");\r\n        }\r\n        if(#!!@blank@ ==0){\r\n            printf(\"\\n\");\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","b","c","d"]},{"option": ["d%4","d%2","a%4","d"]},{"option": ["d%4","d%2","a%2","d"]},{"option": ["d","d%5","a%5","a%2"]}]', '["c","d%2","d","a%2"]', '数（不正解）'),
(425, '<p>下記の出力結果から法則を導きだし，同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b,c;\r\n    scanf(\"%d\",&c);\r\n    for(a=2;a<c;a++){\r\n        if(a%#!!@blank@==0 && a%3==0){\r\n            printf(\"#!!@blank@\");\r\n        }else if(a%2==0 || a%3==0){\r\n            printf(\"#!!@blank@\");\r\n        }else{\r\n            printf(\"#!!@blank@\");\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","2","3"]},{"option": ["+","-","*","%d"]},{"option": ["+","-","*","%d"]},{"option": ["+","-","*","%d"]}]', '["2","*","+","-"]', '数（不正解）'),
(426, '<p>素因数分解するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int i,num = 0,a=-1;\r\n    while (#!!@blank@){\r\n        printf(\"素因数分解したい整数を入力：\");\r\n        scanf(\"%d\", &num);\r\n        if (num < 2){\r\n            printf(\"2以上の整数にしてください\\n\");\r\n        } else{\r\n            break;\r\n        }\r\n    }\r\n    printf(\"%dの素因数は\", num);\r\n\r\n    for (i = 2; i <= num; i++){ \r\n        while (#!!@blank@ == 0){\r\n	    if(#!!@blank@){\r\n            printf(\"%d \", i);\r\n	        a=#!!@blank@;\r\n        }\r\n            num #!!@blank@ i;\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","true",";;"]},{"option": ["a%i","num%a","num % i","i % num"]},{"option": ["a==num","a!=num","a==i","a!=i"]},{"option": ["0","i","num","a+num"]},{"option": ["+=","-=","*=","/="]}]', '["1","num % i","a!=i","i","/="]', '数（不正解）'),
(427, '<p>偶数奇数を判断するプログラムです(０は含めない)<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n    int a,b,c,d=0;\r\n    scanf(\"%d\",&a);\r\n    \r\n    while (a > 0) {//数値を逆順にする\r\n        d = #!!@blank@;\r\n        a /= 10;\r\n    }\r\n    while(d #!!@blank@ 0){\r\n        #!!@blank@;\r\n        printf(\"%d\",c);\r\n        if(c%2==0){\r\n            printf(\"遇\");\r\n        }else{\r\n            printf(\"奇\");\r\n        }\r\n        b=d/10;\r\n        d=0;\r\n        d=#!!@blank@;\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["(a+d)*10","(a+d)%10","a * 10 + d % 10","d * 10 + a % 10"]},{"option": ["<=",">=","!=","=="]},{"option": ["a=d%10","a=c%10","c=d%10","c=b"]},{"option": ["a","b","c","d"]}]', '["d * 10 + a % 10","!=","c=d%10","b"]', '数（不正解）'),
(428, '<p>アスタリスク(*)でピラミッドを作るプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n    int a, b, c;\r\n    scanf(\"%d\", &c);\r\n    for(a = 1; a <= c; a++) {\r\n        for(b = #!!@blank@; b #!!@blank@ 0; b--) {\r\n            printf(\" \");\r\n        }\r\n        for(b = 1; b <= (#!!@blank@); b++) {\r\n            printf(\"*\");\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c-d","c-a","b-c","c-a"]},{"option": [">","<",">=","<="]},{"option": ["2* b - 1","2* c - 1","2* a - 2","2 * a - 1"]}]', '["c-a",">","2 * a - 1"]', '数（不正解）'),
(429, '<p>Fizz-Buzz問題です<br />\r\n下記のルールを参考に出力結果と同じになるように選択肢を選びなさい<br />\r\n1から15までの数をプリントするプログラムを書け。ただし3の倍数のときは数の代わりに｢Fizz｣と、5の倍数のときは｢Buzz｣と出力し、3と5両方の倍数の場合には｢FizzBuzz｣と出力すること。</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void) {\r\n    int a;\r\n    for (a = 1; a <= 15; a++) {\r\n        if (a % 3 == 0 #!!@blank@ a % 5 == 0) {\r\n            printf(#!!@blank@);\r\n        } else if (a % 3 == 0) {\r\n            printf(#!!@blank@);\r\n        } else if (a % 5 == 0) {\r\n            printf(#!!@blank@);\r\n        } else {\r\n            printf(#!!@blank@);\r\n        }\r\n        printf(\" \");\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["==","!=","&&","||"]},{"option": ["\"%d\", a","\"Fizz\"","\"Buzz\"","\"FizzBuzz\""]},{"option": ["\"%d\", a","\"Fizz\"","\"Buzz\"","\"FizzBuzz\""]},{"option": ["\"%d\", a","\"Fizz\"","\"Buzz\"","\"FizzBuzz\""]},{"option": ["\"%d\", a","\"Fizz\"","\"Buzz\"","\"FizzBuzz\""]}]', '["&&","\"FizzBuzz\"","\"Fizz\"","\"Buzz\"","\"%d\", a"]', '数（不正解）'),
(430, '<p>Fizz-Buzz問題です<br />\r\n下記のルールを参考に出力結果と同じになるように選択肢を選びなさい<br />\r\n1から15までの数をプリントするプログラムを書け。ただし3の倍数のときは数の代わりに｢Fizz｣と、5の倍数のときは｢Buzz｣と出力し、3と5両方の倍数の場合には｢FizzBuzz｣と出力すること。</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void) {\r\n    int a,b=2;\r\n    for (a = 1; a <= 15; a++) {\r\n        if (a % 3 == 0) {\r\n            printf(\"Fizz\");\r\n        } \r\n        if (a % 5 == 0) {\r\n            printf(\"Buzz\");\r\n        }\r\n        if(a % 3 #!!@blank@ 0 #!!@blank@ a % 5 #!!@blank@ 0){\r\n            printf(\"%d\", a);\r\n        }\r\n        printf(\" \");\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["<=",">=","!=","=="]},{"option": ["||","&&","==","!="]},{"option": ["<=",">=","!=","=="]}]', '["!=","&&","!="]', '数（不正解）'),
(431, '<p>10から５０までの整数の中から入力した数値の倍数または含まれる整数を出力するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\nint main(void)\r\n{\r\n    int a,b,c,d;\r\n    scanf(\"%d\",&#!!@blank@);\r\n    for(c=10; c<=50; c++) {\r\n        if((c%b)==#!!@blank@) {\r\n            printf(\"%d,\",c);\r\n        }else{\r\n            #!!@blank@ = c%10;\r\n            if(#!!@blank@ ==b) {\r\n                printf(\"%d,\",c);\r\n            }else if(a #!!@blank@ b) {\r\n                printf(\"%d,\",c);\r\n            }\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","b","c","d"]},{"option": ["a","b","0","1"]},{"option": ["a","b","c","d"]},{"option": ["(b%10)/10","(b%10)/10","(c/10)%10","(c%10)/10"]},{"option": ["<=",">=","!=","=="]}]', '["b","0","a","(c/10)%10","=="]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(483, '<p>０を含まない数列を入力して，選択した方（偶数or奇数）を０に変えるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int #!!@blank@;\r\n    \r\n    while(1){\r\n        printf(\"選択してください。(偶数：0,奇数：1)\");\r\n        scanf(\"%d\",&c);\r\n        if(c==0 || c==1){\r\n            #!!@blank@;\r\n        }\r\n        printf(\"0,1以外入力しないでください\\n\");\r\n    }\r\n    printf(\"0を含まない数列を入力してください\\n\");\r\n    scanf(\"%d\",&d);\r\n    while (d > 0) {//数値を逆順にする\r\n        a = a * 10 + #!!@blank@;\r\n        d /= 10;\r\n    }\r\n\r\n    while(a!=0){\r\n        b=a%10;\r\n        if(b%2 #!!@blank@){\r\n            printf(\"%d\",b);\r\n        }else{\r\n            printf(\"%d\",0);\r\n        }\r\n        a=a/10;\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["a,b,c,d","a=0,b,c,d","a,b=0,c,d","a,b=,c=0,d"]},{"option": ["b=c","return 0","return","break"]},{"option": ["d % 10","d  / 10","d  *10","d"]},{"option": ["== c","!= c","==d","!=d"]}]', '["a=0,b,c,d","break","d % 10","!= c"]', '数（不正解）'),
(484, '<p>暑さ指数を算出するプログラムです<br />\r\n下記の式を参考に選択肢を選びなさい<br />\r\n<strong>屋外</strong><br />\r\n&nbsp; &nbsp; 暑さ指数＝0.7 &times; 湿球温度 ＋ 0.2 &times; 黒球温度 ＋ 0.1 &times; 乾球温度<br />\r\n<strong>屋内</strong><br />\r\n&nbsp; &nbsp; 暑さ指数＝0.7 &times; 湿球温度 ＋ 0.３&times; 黒球温度<br />\r\n実行例</p>\r\n\r\n', 'C', '\r\n#include <stdio.h>\r\nint main(void)\r\n{\r\n    int flg;\r\n    double a,b,c,d;\r\n    printf(\"屋外ですか屋内ですか(屋外：1、屋内：2)\");\r\n    scanf(\"%d\",&flg);\r\n\r\n    printf(\"暑さ指数を計算しましょう\\n\");\r\n    printf(\"乾球温度は何℃ですか:\");\r\n    scanf(\"%lf\",&#!!@blank@);\r\n\r\n    printf(\"黒球温度は何℃ですか:\");\r\n    scanf(\"%lf\",&#!!@blank@);\r\n    if(flg!=#!!@blank@){\r\n    	printf(\"湿球温度は何℃ですか:\");\r\n    	scanf(\"%lf\",&#!!@blank@);\r\n    	b=0.7*a+0.2*d+0.1*c;\r\n    }else{\r\n    	b=0.7*a+0.3*d;\r\n    }\r\n    printf(\"暑さ指数%0.2lf℃です\\n\",b);\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","b","c","d"]},{"option": ["a","b","c","d"]},{"option": ["1","2","3","4"]},{"option": ["a","b","c","d"]}]', '["a","c","2","d"]', '数（不正解）'),
(485, '<p>下記の出力結果から法則を導きだし，同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n	int i,j,n;\r\n	scanf(\"%d\",&n);\r\n	for(i=0; i<n*2-1; i++){\r\n		if(i<n){\r\n			for(j=0; j<i*2+1; j++){\r\n				if(#!!@blank@==0){\r\n				    printf(\"*\");\r\n				}else{\r\n				    printf(\"+\");\r\n				}\r\n			}\r\n		}\r\n		else{\r\n    		for(j=0; j<(#!!@blank@)-(#!!@blank@)*2; j++){\r\n			    if(#!!@blank@==0){\r\n				    printf(\"*\");\r\n				}else{\r\n				    printf(\"+\");\r\n				}\r\n			}\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i+j%2","(n+j)%2","(i+n)%2","(i+j)%2"]},{"option": ["n*2-2","n*2-1","n*2+2","n*2+1"]},{"option": ["i+n-1","i+n+1","i-n+1","i+n-1"]},{"option": ["i+n%2","(n+j)%2","(i+n)%2","(i+j)%2"]}]', '["(i+j)%2","n*2-1","i-n+1","(i+j)%2"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(486, '<p>下記の出力結果と同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n    int a,b,c,d;\r\n    printf(\"数列を入力してください(自然数)\\n\");\r\n    scanf(\"%d\",&a);\r\n    \r\n    printf(\"一番小さい数を探しますか（0）\\n\");\r\n    printf(\"一番大きい数を探しますか（1）\\n\");\r\n    scanf(\"%d\",&d);\r\n    if(d==0){\r\n        printf(\"一番小さい\");\r\n        #!!@blank@;\r\n    }else{\r\n        printf(\"一番大きい\");\r\n        #!!@blank@;\r\n    }\r\n    while(a!=0){\r\n        b=a%10;\r\n        if(#!!@blank@){\r\n            c=b; \r\n        }else if(#!!@blank@){\r\n            c=b;\r\n        }\r\n        a=a/10;\r\n    }\r\n    printf(\"値は%dです\\n\",c);\r\n\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c=a","c=d","c=0","c=10"]},{"option": ["c=a","c=d","c=0","c=10"]},{"option": ["b>c && d==1","b>c !! d==1","b>c && d==0","b<c !! d==0"]},{"option": ["c>b || d==1","c>b || d==0","c>b && d==0","b>c && d==1"]}]', '["c=10","c=0","b>c && d==1","c>b && d==0"]', '数（不正解）'),
(487, '<p>２つの値の公約数を求めるプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\nint main (void)\r\n{ \r\n    int a,b,c,d;\r\n    scanf(\"%d %d\",&a,&b);\r\n    #!!@blank@;\r\n    if(#!!@blank@){\r\n        c=b;\r\n    }\r\n    printf(\"%dと%dの公約数は,\",a,b);\r\n    for(d=1;#!!@blank@;d++){\r\n        if(a%d==0&&b%d==0){\r\n            printf(\"%d,\",d);\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c=a","c=b+1","c=0","c=d"]},{"option": ["a<b","a>b","a==b","c>b"]},{"option": ["d>c","d>c+1","d<c+1","d<c1"]}]', '["c=a","a>b","d<c+1"]', '数（不正解）'),
(488, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n(180の素因数は2,3,5の３つです)</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int num=180;\r\n    int a=-1,b=0,c,d=0,e,f,g=0;\r\n    printf(\"%dの素因数をすべて答えよ\\n\",num);\r\n    for (#!!@blank@){ //答えを作成\r\n        while (num % c == 0){\r\n	    if(a!=c){\r\n	        b=b*10+c;\r\n	        a=c;\r\n                }\r\n        num /= c;\r\n        }\r\n    }\r\n    while(1){\r\n        scanf(\"%d\",&f);\r\n        while(b!=0){\r\n            #!!@blank@=b%10;\r\n            if(e==1 || #!!@blank@){\r\n                g=g*10+#!!@blank@;\r\n                d++;\r\n            }else{\r\n                g=g*10+#!!@blank@;\r\n            }\r\n            b=b/10;\r\n        }\r\n        #!!@blank@;\r\n        if(b==111){\r\n            printf(\"すべて答えました\\n\");\r\n            break;\r\n        }\r\n        printf(\"あと%d個あるよ\\n\",3-d);\r\n        g=0;\r\n        d=0;\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a = 2; a <= num; a++","b = 2; b <= num; b++","c = 2; c <= num; c++","d = 2; d <= num; d++"]},{"option": ["e","g","0","1"]},{"option": ["e==g","e==f","e==b","e==c"]},{"option": ["e","g","0","1"]},{"option": ["1","b","e","g"]},{"option": ["b=a","b=g","b=e","b=d"]}]', '["c = 2; c <= num; c++","e","e==f","1","e","b=g"]', '数（不正解）');
