(489, '<p>下記の出力結果から法則を導きだし，同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\nint main (void)\r\n{ \r\n    int #!!@blank@;\r\n\r\n    while(#!!@blank@){\r\n        printf(\"選べ（アウト:0 シングルヒット：1）\\n\");\r\n        scanf(\"%d\",&c);\r\n        if(c==1){\r\n            #!!@blank@;\r\n            if(a>3){\r\n                printf(\"ホームイン\\n\");\r\n            }\r\n        }else{\r\n            #!!@blank@;\r\n        }\r\n    }\r\n    if(#!!@blank@){\r\n        printf(\"得点になりませんでした\");\r\n    }else{\r\n        printf(\"%d点でした\\n\",a-3);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a,b,c","a=0,b,c","a,b=0,c","a=0,b=0,c"]},{"option": ["b<4","b<2","b<3","b<=4"]},{"option": ["a++","b++","a=1","b=1"]},{"option": ["a++","b++","a=1","b=1"]},{"option": ["a<4","a<=3","a<3","a<=4"]}]', '["a=0,b=0,c","b<3","a++","b++","a<3"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(490, '<p>下記の出力結果と同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int inning=0,change=0,out,hitID,end;\r\n    int senko=0,koko=0;\r\n    printf(\"イニング数を決めてください\\n\");\r\n    scanf(\"%d\",&end);\r\n    while(1){\r\n        if(change==0){\r\n            printf(\"%d回表先攻チームの攻撃\\n\",inning+1);\r\n            change=1;\r\n        }else{\r\n            printf(\"%d回裏後攻チームの攻撃\\n\",inning+1);\r\n            change=0;\r\n        }\r\n        out=0;\r\n        while(out<3){\r\n            printf(\"アウト(0),ホームラン(1)\\n\");\r\n            scanf(\"%d\",&hitID);\r\n            if(hitID #!!@blank@ 1){\r\n                #!!@blank@; \r\n            }else{\r\n                if(change==1){\r\n                    #!!@blank@;\r\n                }else{\r\n                    #!!@blank@;\r\n                }\r\n                printf(\"一点追加\\n\");\r\n            }\r\n        }\r\n        printf(\"3アウトチェンジ\\n\");\r\n        if(change==0){\r\n            inning++;\r\n        }\r\n        printf(\"先攻:%d vs 後攻:%d\\n\",senko,koko);\r\n        if(#!!@blank@){\r\n            break;\r\n        }\r\n    }\r\n    if(senko#!!@blank@ koko){\r\n        printf(\"先攻チームの勝利\\n\");\r\n    }else if(senko #!!@blank@ koko){\r\n        printf(\"後攻チームの勝利\\n\");\r\n    }else{\r\n        printf(\"引き分け\\n\");\r\n    }  \r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["==","!=",">",">="]},{"option": ["senko++","koko++","out++","change=0"]},{"option": ["senko++","koko++","out++","change=1"]},{"option": ["senko++","koko++","out++","change=0"]},{"option": ["change==end","inning==end","inning==change","inning==change"]},{"option": [">=",">","<=","<"]},{"option": [">=",">","<=","<"]}]', '["!=","out++","senko++","koko++","inning==end",">","<"]', '数（不正解）');
