(491, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n    int i,b;\r\n    scanf(\"%d\",&b);\r\n	int #!!@blank@ ;\r\n	\r\n	for( i=0; #!!@blank@ ;i++){\r\n	    a[i]=#!!@blank@;\r\n	    printf(\"%d\\n\",a[i]);\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","b","a[b]","b[a]"]},{"option": ["i<a","i<b","i<=a","i<=b"]},{"option": ["i","i+1","b-i","b-i+1"]}]', '["a[b]","i<b","i+1"]', '数（不正解）'),
(492, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void)\r\n{\r\n	int #!!@blank@={0,1,2,3} ;\r\n	for(#!!@blank@; i<4;i++){\r\n	    printf(\"%d\\n\",#!!@blank@);\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i","a","a[3]","a[]"]},{"option": ["i=0","i=1","int i=0","int i=1"]},{"option": ["a[i]+1","a[i]-1","a[i]+i","a[i]-i"]}]', '["a[]","int i=0","a[i]+i"]', '数（不正解）'),
