(496, '<p>配列を昇順に並べ替えるプログラムである<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n#define NUM 100\r\n\r\nint main(void) {\r\n    int a[]={35,5,40,20};\r\n    int b,c,d;\r\n    printf(\"処理前\\n\");\r\n    for(c=0;c<4;c++){\r\n        printf(\"%d \",a[c]);\r\n    }\r\n    printf(\"\\n\");\r\n    printf(\"処理後\\n\");\r\n    for(c=0; #!!@blank@ ;c++){\r\n        for(d=c+1; #!!@blank@ ;d++){\r\n            if(#!!@blank@){\r\n                #!!@blank@=a[c];\r\n                a[c]=#!!@blank@ ;\r\n                #!!@blank@ =b;\r\n            }\r\n        }\r\n    }\r\n    for(c=0;c<4;c++){\r\n        printf(\"%d \",a[c]);\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["c<a","c<a[0]","c<3","c<4"]},{"option": ["d<3","d<4","d<c","d<=c"]},{"option": ["a[d] > a[c]","a[c] > a[d]","a[d-1] > a[d]","a[c-1] > a[c]"]},{"option": ["a[d]","b","c+1","a[d-c]"]},{"option": ["a[c-1]","a[b]","a[c]","a[d]"]},{"option": ["a[b-1]","a[c]","a[d-c]","a[d]"]}]', '["c<3","d<4","a[c] > a[d]","b","a[d]","a[d]"]', '数（不正解）');
