(498, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n#define NUM 100\r\n\r\nint main(void) {\r\n    int a[NUM], i, j, num, x;\r\n    printf(\"配列の長さを指定してください:\");\r\n    scanf(\"%d\",&num);\r\n    for( i=0; i<num; i++ ){\r\n        printf(\"a[%d] =\",i);\r\n        scanf(\"%d\",&a[i]);\r\n    }\r\n    printf(\"\\n\");\r\n    i = 0;\r\n    j = num-1; \r\n    while(  #!!@blank@  ) {\r\n        x = #!!@blank@;\r\n        a[i] = a[j];\r\n        #!!@blank@ = x;\r\n        i = #!!@blank@;\r\n        j = #!!@blank@;\r\n    }\r\n    for( i=0; i<num; i++ ){\r\n        printf(\"a[%d] = %d\\n\",i,a[i]);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["j<i","i<j+1","j+1<i","i<j"]},{"option": ["i","j","a[i]","a[j]"]},{"option": ["i","j","a[i]","a[j]"]},{"option": ["i-1","i+1","j-1","j+1"]},{"option": ["i-1","i+1","j-1","j+1"]}]', '["i<j","a[i]","a[j]","i+1","j-1"]', '数（不正解）');
