(509, '<p>ある法則で配列の値が決まります<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main(void){\r\n    \r\n    int c;\r\n    printf(\"入力してください:\");\r\n    scanf(\"%d\",&c);\r\n    int a[c],b[c];\r\n    a[0]=#!!@blank@;\r\n    \r\n    for(int #!!@blank@;i++){\r\n        printf(\"%d個目:\",i);\r\n        scanf(\"%d\",&a[i]);\r\n    }\r\n    for(int i=0;i<c;i++){\r\n        printf(\"%d \",a[i+1]);\r\n    }\r\n    printf(\"\\n\");\r\n    \r\n    for(int i=0;i<c;i++){\r\n        b[i]=#!!@blank@;\r\n    }\r\n    \r\n    for(int i=0;i<c;i++){\r\n        printf(\"%d \",b[i]);\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["0","1","2","3"]},{"option": ["i=0;i<c","i=0;i<=c","i=1;i<=c","i=1;i<=c"]},{"option": ["a[i]*i","a[i]]*a[i]","a[i+1]*a[i]","a[i+1]*i"]}]', '["2","i=1;i<=c","a[i+1]*a[i]"]', '数（不正解）'),
(510, '<p>入力した数値を探索プログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a[] = {#!!@blank@ ,#!!@blank@};\r\n    int b,c=#!!@blank@;   \r\n    printf(\"探索する数値を入力してください：\");\r\n    scanf(\"%d\",&b);\r\n    \r\n    for (int i=1; i<=c; i++) {\r\n        if (#!!@blank@) {\r\n            printf(\"%dは %d 番目でした\\n\",b, i);\r\n            break;\r\n        }\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["3, 5, 6, 9","5, 3, 6, 9","5, 6, 3, 9","5, 6, 9, 3"]},{"option": ["4, 1, 2, 7","1, 4, 2, 7","1, 2, 4, 7","1, 2, 7, 4"]},{"option": ["0","7","8","9"]},{"option": ["a[i] != b","a[i] == b","a[i-1] != b","a[i-1] == b"]}]', '["5, 6, 9, 3","1, 4, 2, 7","8","a[i-1] == b"]', '数（不正解）'),
(511, '<p>フィナボッチ数列を生成するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n下記は公式です</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include<stdio.h>\r\n\r\nint main(void){\r\n    int a[11];\r\n\r\n    for(int b=0; b<=10; b++){   \r\n        if(#!!@blank@){\r\n            a[b] = #!!@blank@;\r\n        }else{\r\n            a[b] = #!!@blank@;\r\n        }\r\n    }\r\n    \r\n    for(int b=0; b<=10; b++){   \r\n        printf(\"F%d=%d\\n\",b, a[b]);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b>0","b<1","b<2","b<3"]},{"option": ["b","b+1","0","1"]},{"option": ["a[b+1]+a[b-2]","a[b-1]+a[b-2]","a[b+1]+a[b+2]","a[b-1]+a[b+2]"]}]', '["b<2","b","a[b-1]+a[b-2]"]', '数（不正解）'),
(512, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b[10],c=0;\r\n    \r\n    for(int i=0;i<=9;i++){\r\n        b[i]=-1;\r\n    }\r\n    \r\n    while(#!!@blank@){\r\n        scanf(\"%d\",&#!!@blank@);\r\n        #!!@blank@;\r\n    }\r\n    \r\n    for(int i=0;i<=9;i++){\r\n        if(#!!@blank@){\r\n            printf(\"%d:%d \",i,0);    \r\n        }else{\r\n            printf(\"%d:%d \",i,b[i]+1);\r\n        }\r\n    }\r\n    printf(\"\\n\");\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c!=9","a!=9","c!=10","c==10"]},{"option": ["a","b[c]","c","b"]},{"option": ["c++","b[c]=1","b[c]=a","b[c]++"]},{"option": ["i==-1","b[i]==-1","b[c]==-1","b[i]==-b[c]"]}]', '["c!=10","c","b[c]++","b[c]==-1"]', '数（不正解）');
