(513, '<p>エラトステネスのふるい（素数を判定するものの一つ）です<br />\r\n&nbsp; &nbsp;下記の出力結果と同じになるように選択肢を選びなさい<br />\r\nまた，下記に示した説明を参考しなさい．<br />\r\nエラトステネスのふるい(100（変数a）までの場合)※簡略化<br />\r\n1：2 から 100 までの整数を並べる。<br />\r\n2：2以外の２の倍数を消す，3以外の3倍数を消す，5以外の5の倍数を消す．．．<br />\r\n3：2の操作を繰り返していき， 100/2(a/2)を越えたら終了。最終的に残ったものが素数。</p>\r\n\r\n<p>入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n    int a=100;\r\n    int p[a];\r\n\r\n    for(int i=0 ; i<a ; i++){\r\n        p[i] = 0;\r\n    }\r\n    p[0] = 2;\r\n\r\n    for(int #!!@blank@ ; b<=a/2 ; b++){\r\n        for(int #!!@blank@ ; #!!@blank@ ; c++){\r\n            p[#!!@blank@] = 1;\r\n        }\r\n    }\r\n    \r\n    for(int i=0 ; i<a ; i++){\r\n        if(#!!@blank@){\r\n            printf(\"%2d,\", i+1);\r\n        }else{\r\n            printf(\"×,\");         \r\n        }\r\n\r\n        if((i+1)%10==0){\r\n            printf(\"\\n\");\r\n        }\r\n    }\r\n    \r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["b=0","b=1","b=2","b=3"]},{"option": ["c=0","c=1","c=2","c=3"]},{"option": ["a*b<=c","b*c<=a","b*c<=a","c*b<p[b]"]},{"option": ["b*c-1","b*c+1","b*c","b+1"]},{"option": ["p[0] == 0","p[i] != 1","p[i] == 0","p[i] == 1"]}]', '["b=2","c=2","b*c<=a","b*c-1","p[i] == 0"]', '数（不正解）'),
(514, '<p dir=\"ltr\">探索プログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include  <stdio.h>\r\n\r\nint main(void)\r\n{\r\n    int  a, b= 0,c=5;\r\n    int  d[c], e[c];\r\n\r\n    printf(\"%d個の整数を入力してください。\\n\", c);\r\n    for (int i = 0; i < c; i++) {\r\n        printf(\"d[%d]：\", i);\r\n        scanf(\"%d\", &d[i]);\r\n    }\r\n    printf(\"探す値：\");\r\n    scanf(\"%d\", &a);\r\n\r\n    for (int i = 0; #!!@blank@; i++){\r\n        if (d[i] #!!@blank@ a){\r\n            #!!@blank@ = i;\r\n        }\r\n    }\r\n    if (b == 0){\r\n        printf(\"一致する要素は存在しません。\");\r\n    }else {\r\n        printf(\"一致する要素は以下の%d個です。\\n\", b);\r\n        for (int i = 0; #!!@blank@; i++){\r\n            printf(\"d[%d] \", #!!@blank@);\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i < c","i <= c","i<b","i<a"]},{"option": ["<=",">=","==","!="]},{"option": ["e[c]","b","e[b]","e[b++]"]},{"option": ["i < a","i < b","i < c","i<e[b]"]},{"option": ["e[b]","i","e[i]","0"]}]', '["i < c","==","e[b++]","i < b","e[i]"]', '数（不正解）'),
(515, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,b[100],c=0,d,e,f;\r\n    printf(\"配列の長さを指定してください:\");\r\n    scanf(\"%d\",&a);\r\n    for(e=0;e<a;e++){\r\n        printf(\"%d個目:\",e+1);\r\n        scanf(\"%d\",&b[e]);\r\n    }\r\n    b[e]=#!!@blank@;\r\n    printf(\"探索したい値を入力してください\\n\");\r\n    scanf(\"%d\",&d); \r\n    for(c=0;#!!@blank@ 0,#!!@blank@ ;c++){\r\n        printf(\"探索中...\");\r\n        #!!@blank@;\r\n    }\r\n    printf(\"\\n\");\r\n    if(b[c]==0){\r\n        printf(\"見つかりませんでした\\n\");\r\n    }else{\r\n        printf(\"%d個目にありました\\n\",f);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a","c","d","e"]},{"option": ["b[c]!=","b[c]==","b[d]!=","b[d]=="]},{"option": ["b[c]==d","b[c]!=d","b[d]==c","b[d]!=c"]},{"option": ["e=c+1","d=c","f=c+2","e=c+2"]}]', '["c","b[c]!=","b[c]!=d","f=c+2"]', '数（不正解）');
