(516, '<p>2分探索のプログラムです<br />\r\n下記の図と出力結果と同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /> <img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main(void)\r\n{\r\n    int arry[] = {2, 4, 5, 8, 9};\r\n    int low, mid, high,target;\r\n\r\n    printf(\"探索対象の値 : \");\r\n    for (int i=0; i<5; i++) {\r\n        printf(\"%2d, \", arry[i]);\r\n    }\r\n    printf(\"\\n\");\r\n    \r\n    scanf(\"%d\",&target);\r\n    high = 4;\r\n    low = 0;\r\n\r\n    while (low #!!@blank@ high) {\r\n        mid = #!!@blank@;\r\n\r\n        printf(\"low=%d, mid=%d. high=%d\\n\",low, mid, high) ;\r\n\r\n        if (arry[mid] == target) {\r\n            #!!@blank@;\r\n        } else if (arry[mid] < target) {\r\n            #!!@blank@;\r\n        } else {\r\n            #!!@blank@;\r\n        }\r\n    }\r\n    if(arry[mid] == target){\r\n        printf(\"値 %d は %d 番目に見つかりました\\n\",target, mid + 1);\r\n    }else{\r\n        printf(\"ありませんでした\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["==","<=",">=","<"]},{"option": ["low + high","low - high","(high + low) / 2","(high - low) / 2"]},{"option": ["low = mid + 1","high = mid - 1","break","continue"]},{"option": ["low = mid + 1","high = mid - 1","break","continue"]},{"option": ["low = mid + 1","high = mid - 1","break","continue"]}]', '["<=","(high + low) / 2","break","low = mid + 1","high = mid - 1"]', '数（不正解）');
