(520, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int b,c=2;\r\n    printf(\"数値を入力してください：\");\r\n    scanf(\"%d\",&b);\r\n    int a[b][c];\r\n    \r\n    for(int i =0;i<b;i++){\r\n        scanf(\"%d %d\",&a#!!@blank@,&a#!!@blank@);\r\n    }\r\n    for(int i=0;i<b;i++){\r\n        for(int #!!@blank@;j++){\r\n            printf(\"%d:\",a[i][j]);\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["[i][c-2]","[i][c-1]","[i][c+1]","[i][c]"]},{"option": ["[i][c-2]","[i][c-1]","[i][c+1]","[i][c]"]},{"option": ["j=0;j<b","j=0;j<=b","j=0;j<c","j=0;j<=c"]}]', '["[i][c-2]","[i][c-1]","j=0;j<c"]', '数（不正解）'),
(521, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a[2][2]={{1,2},{3,4}};\r\n    int b[2][2]={{5,6},{7,8}};\r\n    int c[2][2];\r\n    \r\n    for(#!!@blank@) {\r\n        for(#!!@blank@) {\r\n            c[i][j] = 0 ;\r\n            for(#!!@blank@){\r\n                c[i][j] += a#!!@blank@*b#!!@blank@ ;\r\n            }\r\n        }\r\n    }\r\n    printf(\"計算結果\\n\");\r\n    for(int i=0;i<2;i++){\r\n        printf(\"%d %d\\n\",c[i][0],c[i][1]);\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["int c=0;c<2;c++","int j=0;j<2;j++","int k=0;k<2;k++","int i=0;i<2;i++"]},{"option": ["int c=0;c<2;c++","int j=0;j<2;j++","int k=0;k<2;k++","int i=0;i<2;i++"]},{"option": ["int c=0;c<2;c++","int j=0;j<2;j++","int k=0;k<2;k++","int i=0;i<2;i++"]},{"option": ["[i][j]","[i][k]","[k][i]","[k][j]"]},{"option": ["[i][j]","[i][k]","[k][i]","[k][j]"]}]', '["int i=0;i<2;i++","int j=0;j<2;j++","int k=0;k<2;k++","[i][k]","[k][j]"]', '数（不正解）');
