(522, '<p>パスカルの三角形を表示するプログラムです<br />\r\n一段上の左右の値の和が自身の値になります<br />\r\n例えば，４段目の「4」の場合，3段目（一上の段）の1と3の和です<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n#define MAX_N 10\r\n\r\nint main(void)\r\n{\r\n    int n;\r\n    int a[MAX_N + 1][MAX_N + 1];\r\n    for (int i = 1; i <=MAX_N; i++) {\r\n        for (int j = 1; j <= MAX_N; j++) {\r\n            if (#!!@blank@){\r\n                a[i][j] = 1;\r\n            }else if (#!!@blank@) {\r\n                a[i][j] = 1;\r\n                break;\r\n            }else{\r\n                a[i][j] = #!!@blank@;\r\n			}\r\n        }\r\n    }\r\n    for (int i = 1; i <=MAX_N; i++) {\r\n        n = (MAX_N - i) * 3;\r\n        while (n--){\r\n			printf(\" \");\r\n		}\r\n        for (int j = 1; j <= MAX_N; j++) {\r\n            if (i == j) { \r\n                printf(\"%3d\", a[i][j]);\r\n                break;\r\n            }else{\r\n                printf(\"%3d   \", a[i][j]);\r\n			}\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["j!=1","j==1","j!=MAX_N","j==MAX_N"]},{"option": ["i==1","j==1","j==i","i==MAX_N"]},{"option": ["a[i - 1][j - 1] + a[i - 1][j - 2]","a[i - 1][j - 1] + a[i - 1][j]","a[i][j - 1] + a[i + 1][j - 1]","a[i + 1][j - 1] + a[i + 1][j]"]}]', '["j==1","j==i","a[i - 1][j - 1] + a[i - 1][j]"]', '数（不正解）'),
(523, '<p>下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int b=#!!@blank@,j,k,m;\r\n    int a[5][b];\r\n    \r\n    for(int i=0; i<5; i++){\r\n        for(j=0; j<5-(i+1); j++){\r\n            a[i][j]=0;\r\n        }\r\n        for(k=0; k<#!!@blank@; k++){\r\n            a[i][j+k]=1;\r\n        }\r\n        for(m=0; m<#!!@blank@; m++){\r\n            #!!@blank@=0;\r\n        }\r\n    }\r\n     for(int i=0;i<5;i++){\r\n        for(int j=0;j<b;j++){\r\n            if(a[i][j]==0){\r\n                printf(\" \");\r\n            }else{\r\n                printf(\"*\");\r\n            }\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["7","8","9","10"]},{"option": ["(i-1)*2-1","(i+1)*2+1","(i+1)*2-1","i*2+1"]},{"option": ["5-(i+1)","5-i","5-(i-1)","5-i+1"]},{"option": ["a[i][j]","a[i][j+k+m]","a[i][k+m]","a[i][m]"]}]', '["9","(i+1)*2-1","5-(i+1)","a[i][j+k+m]"]', '数（不正解）');
