(524, '<p>九九表を表示するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n\r\nint main()\r\n{\r\n	int a,b;\r\n	int c#!!@blank@;\r\n\r\n	for(a=0;a<=9;a++){\r\n		for(b=0;b<=9;b++){\r\n			#!!@blank@;\r\n		}\r\n	}\r\n\r\n	printf(\"九九表\\n\");\r\n	printf(\"  \");\r\n	for(#!!@blank@;a++){\r\n		printf(\"%3d\",a);\r\n	}\r\n\r\n	printf(\"\\n------------------------------\\n\");\r\n\r\n	for(a=0;a<9;a++){\r\n		printf(\"%d|\",a);\r\n		for(b=1;b<=9;b++){\r\n			printf(\"%3d\",#!!@blank@);\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["[][10]","[10][10]","[][9]","[9][9]"]},{"option": ["c[a][b]=a*b","c[a-1][b]=(a-1)*b","c[a][b-1]=a*(b-1)","c[a-1][b-1]=(a-1)*(b-1)"]},{"option": ["a=0;a<9","a=1;a<=9","a=1;a<9","a=0;a<=9"]},{"option": ["c[a][b]","c[a+1][b]","c[a][b+1]","c[a-1][b+1]"]}]', '["[10][10]","c[a][b]=a*b","a=1;a<=9","c[a+1][b]"]', '数（不正解）'),
(525, '<p>ある法則で配列の値が決まります<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a[5][5],b;\r\n    \r\n    for(int i=2;i<#!!@blank@;i=i+2){\r\n        for(int j=2;j<=#!!@blank@;j=j+2){\r\n            if(#!!@blank@==0){\r\n                b=0;\r\n            }else if(#!!@blank@==1){\r\n                b=1;\r\n            }else{\r\n                b=2;\r\n            }\r\n            a#!!@blank@=b;\r\n        }\r\n    }\r\n    for(int i=0;i<5;i++){\r\n        for(int j=0;j<5;j++){\r\n            switch(a[i][j]){\r\n                case 0:\r\n                    printf(\"〇\");\r\n                    break;\r\n                case 1:\r\n                    printf(\"◆\");\r\n                    break;\r\n                case 2:\r\n                    printf(\"△\");\r\n                    break;\r\n            }\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n     return 0;  \r\n  }', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["b*2+1","5*2","5*2+1","5*2+2"]},{"option": ["b*2+1","5*2","5*2+1","5*2+2"]},{"option": ["i*j%5","i*j%3","i+j%5","i*j%7"]},{"option": ["i*j%5","i*j%3","i+j%5","i*j%7"]},{"option": ["[i/2][j/2]","[i/2-1][j/2-1]","[i][j]","[i-1][j-1]"]}]', '["5*2+2","5*2+1","i*j%5","i*j%5","[i/2-1][j/2-1]"]', '数（不正解）'),
(526, '<p>転置の処理をするプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n \r\nint main(void){\r\n	int row=3, col=2;\r\n	int a[3][2]={{1,2},\r\n			{4,5},\r\n			{7,8}};\r\n	int b[3][2];\r\n\r\n	printf(\"転置前\\n\");\r\n	for(int i=0;i<row;i++){\r\n		for(int j=0;j#!!@blank@;j++){\r\n			printf(\"%d  \", #!!@blank@);\r\n			b[i][j]=a[i][j];\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n\r\n	printf(\"転置行列\\n\");\r\n	for(int i=0;i<col;i++){\r\n		for(int j=0;j<row;j++){\r\n			printf(\"%d  \",#!!@blank@);\r\n		}\r\n		printf(\"\\n\");\r\n	}\r\n	\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["<row","<i","<col","<=i"]},{"option": ["a[j][i]","a[i][j]","b[j][i]","b[i][j]"]},{"option": ["a[j][i]","a[i][j]","a[i][i]","b[i][j]"]}]', '["<col","a[i][j]","a[j][i]"]', '数（不正解）');
