(527, '<p>ビンゴゲームを模したプログラムです（縦or横が０で並んだらビンゴです）<br />\r\n※斜めが並んでいてもビンゴになりません<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /> <img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n \r\nint main(void){\r\n    int card[3][3]={{1,2,3},{4,5,6},{7,8,9}};\r\n    int a,b,c,flg=0;\r\n    while(flg==0){\r\n        for(int i=0;i<3;i++){\r\n            for(int j=0;j<3;j++){\r\n                printf(\"|%d|\",card[i][j]);\r\n            }\r\n            printf(\"\\n\");\r\n        }\r\n        \r\n        printf(\"値を入力してください\\n\");\r\n        scanf(\"%d\",&a);\r\n        for(int i=0;i<3;i++){\r\n            for(int j=0;j<3;j++){\r\n                if(#!!@blank@){\r\n                    card[i][j]=0;\r\n                }\r\n            }    \r\n        }\r\n\r\n        for(int i=0;i<3;i++){\r\n            b=c=0;\r\n            for(int j=0;j<3;j++){\r\n                b#!!@blank@;\r\n                c#!!@blank@;\r\n            }\r\n            if(#!!@blank@){\r\n                printf(\"ビンゴ\\n\");\r\n                flg=1;\r\n                break;\r\n            }\r\n        }\r\n    }\r\n    for(int i=0;i<3;i++){\r\n        for(int j=0;j<3;j++){\r\n            printf(\"|%d|\",card[i][j]);\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n \r\n  return 0; \r\n}', '{"example1": {"in": "", "out": ""}}', 10, '[{"option": ["card[i][j]==i*j","card[j][i]==a","card[i][j]==i+j","card[i][j]==a"]},{"option": ["+=card[i][j]","+=card[j][i]","=card[i][j]","=card[j][i]"]},{"option": ["+=card[i][j]","+=card[j][i]","=card[i][j]","=card[j][i]"]},{"option": ["b==0 && c==0","b==1 || c==1","b==0 || c==0","b+c==0"]}]', '["card[i][j]==a","+=card[i][j]","+=card[j][i]","b==0 || c==0"]', '数（不正解）');
