(528, '<p>ビンゴゲームを模したプログラムです（斜めが０で並んだらビンゴです）<br />\r\n※縦or横が並んでいてもビンゴになりません<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /> <img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\n \r\nint main(void){\r\n    int card[3][3]={{1,2,3},{4,5,6},{7,8,9}};\r\n    int a,b,c;\r\n    while(1){\r\n        for(int i=0;i<3;i++){\r\n            for(int j=0;j<3;j++){\r\n                printf(\"|%d|\",card[i][j]);\r\n            }\r\n            printf(\"\\n\");\r\n        }\r\n        \r\n        printf(\"値を入力してください\\n\");\r\n        scanf(\"%d\",&a);\r\n        for(int i=0;i<3;i++){\r\n            for(int j=0;j<3;j++){\r\n                if(card[i][j]==a){\r\n                    card[i][j]=0;\r\n                }\r\n            }    \r\n        }\r\n        c=b=0;\r\n        for(int i=0;i<3;i++){\r\n            b#!!@blank@;\r\n            for(int j=0;j<3;j++){\r\n                if(#!!@blank@){\r\n                    c+=card[i][j];\r\n                }\r\n            }\r\n        }\r\n        if(#!!@blank@){\r\n            printf(\"ビンゴ\\n\");\r\n            break;\r\n        }\r\n        if(#!!@blank@){\r\n            printf(\"リーチ\\n\");\r\n        }\r\n    }\r\n    for(int i=0;i<3;i++){\r\n        for(int j=0;j<3;j++){\r\n            printf(\"|%d|\",card[i][j]);\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n \r\n  return 0; \r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["+=card[i][i]","+=card[j][j]","+=card[i][j]","+=card[j][i]"]},{"option": ["i+j==0","i*j==1","i+j==2","i+j==1"]},{"option": ["b%2==0 || c%2==0","b!=0 || c!=0","b==0 && c==0","b==0 || c==0"]},{"option": ["b<10 && c<10","b<10 || c<10","b>0 || c<0","b>=0 || c>=0"]}]', '["+=card[i][i]","i+j==2","b==0 || c==0","b<10 || c<10"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(529, '<p>学生の各教科の成績を入力すると表形式（平均を含む）で出力するプログラムです<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a;\r\n    printf(\"人数を入力してください：\");\r\n    scanf(\"%d\",&a);\r\n    int b[a][4],c,#!!@blank@;\r\n    double e;\r\n    for(int i=0;i<a;i++){\r\n        printf(\"%d人目の成績\\n\",i+1);\r\n        for(int j=0;j<#!!@blank@;j++){\r\n            switch(j){\r\n                case 0:\r\n                    printf(\"#!!@blank@\");\r\n                    break;\r\n                case 1:\r\n                    printf(\"#!!@blank@\");\r\n                    break;\r\n                case 2:\r\n                    printf(\"#!!@blank@\");\r\n                    break;\r\n                case 3:\r\n                    printf(\"#!!@blank@\");\r\n                    break;\r\n            }\r\n            printf(\"の点数:\");\r\n            scanf(\"%d\",&b[i][j]);\r\n        }\r\n    }\r\n	printf(\"成績表\\n\");\r\n	printf(\"ID  国語　数学　英語　理科　 平均\\n\");\r\n\r\n	printf(\"------------------------------\\n\");\r\n    for(int i=0;i<a;i++){\r\n        c=0;\r\n        printf(\"id%d\",i+1);\r\n        for(int j=0;j<d;j++){\r\n            printf(\"%5d\",b[i][j]);\r\n            c+=b[i][j];\r\n        }\r\n        e=#!!@blank@;\r\n        printf(\"  || \");\r\n        printf(\"%4.2lf\",e);\r\n        printf(\"\\n\");\r\n        printf(\"------------------------------\\n\");\r\n    }\r\n    printf(\"   \");\r\n    for(int j=0;j<d;j++){\r\n        c=0;\r\n        for(int i=0;i<a;i++){   \r\n            c+=b[i][j];\r\n        }\r\n        e=#!!@blank@;\r\n        printf(\" %3.2lf|\",e);\r\n    }\r\n    printf(\"\\n\");\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["c","d","d=2","d=4"]},{"option": ["a","c","3","4"]},{"option": ["英語","国語","数学","理科"]},{"option": ["英語","国語","数学","理科"]},{"option": ["英語","国語","数学","理科"]},{"option": ["英語","国語","数学","理科"]},{"option": ["c/i","(double)c/a","(double)c/d","c/d"]},{"option": ["c/e","(double)c/a","(double)c/d","c/d"]}]', '["d=4","4","国語","数学","英語","理科","(double)c/d","(double)c/a"]', '数（不正解）'),
(530, '<p>ある法則で配列の値が決まります<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a=3,c=9,d=4;\r\n    \r\n    int b[c][c];\r\n    for(int i=0;#!!@blank@;i++){\r\n        for(int j=0;#!!@blank@;j++){\r\n            if(#!!@blank@){\r\n                b[i][j]=0;\r\n            }else{\r\n                b[i][j]=1;\r\n            }\r\n        }\r\n    }\r\n    for(int i=1;#!!@blank@;i++){\r\n        for(int j=0; #!!@blank@ ;j++){\r\n            if(b[i-1][j]==1){\r\n                printf(\"〇\");   \r\n            }else{\r\n                printf(\"◆\");\r\n            }\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i<c+1","i<c","i<=c","i!=c"]},{"option": ["j<c","j<c+1","j<=c","j==c"]},{"option": ["i%j*2==1","i+j%2==0","i*j%2==0","i*j%2==1"]},{"option": ["i<c+1","i<c","i<=c","i!=c"]},{"option": ["j<c-1","j<=c","j<=c-1","j<i"]}]', '["i<c","j<c","i*j%2==0","i<c+1","j<=c-1"]', '数（不正解）');
