(531, '<p>ある法則で配列の値が決まります<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,c,d,e;\r\n    printf(\"数値を入力してください\\n\");\r\n    scanf(\"%d\",&a);\r\n    c=#!!@blank@;\r\n    int b[c][c];\r\n    for(int i=0;i<c;i++){\r\n        for(int j=0;j<c;j++){\r\n            b[i][j]=0;\r\n        }\r\n    }\r\n    for(int i=0;#!!@blank@;i++){\r\n            e=#!!@blank@;\r\n            d=#!!@blank@;\r\n            b[d][i]=1;\r\n            b[d][e]=1;\r\n            #!!@blank@;\r\n            b[d][i]=1;\r\n            b[d][e]=1;\r\n    }\r\n    for(int i=0;i<c;i++){\r\n        for(int j=0;j<c;j++){\r\n            if(b[i][j]==1){\r\n                printf(\"〇\");   \r\n            }else{\r\n                printf(\"◆\");\r\n            }\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a-1","a+1","2*a-1","2*a+1"]},{"option": ["i<a","i<a-1","i<c","i<=c"]},{"option": ["c-i","c-i-1","c+i+1","c+i"]},{"option": ["a+i","a+i+1","a+i-1","a-i-1"]},{"option": ["c=a-i+1","d=a-i+2","c=a-i-1","d=a-i-1"]}]', '["2*a-1","i<a","c-i-1","a+i-1","d=a-i-1"]', '数（不正解）'),
(532, '<p>ある法則で配列の値が決まります<br />\r\n下記の出力結果と同じになるように選択肢を選びなさい<br />\r\n入出力例</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n', 'C', '#include <stdio.h>\r\nint main(void){\r\n    int a,c,d,e;\r\n    printf(\"数値を入力してください\\n\");\r\n    scanf(\"%d\",&a);\r\n    c=2*a-1;\r\n    int b[c][c];\r\n\r\n    for(int i=0;i<a;i++){\r\n        if(i%2==0){\r\n            d=#!!@blank@;\r\n            e=#!!@blank@;\r\n            for(int j=#!!@blank@;j<#!!@blank@;j++){\r\n                b[a-e][j]=1;\r\n                b[a+d][j]=1;\r\n                b[j][a-e]=1;\r\n                b[j][a+d]=1;\r\n            }\r\n        }else{\r\n            for(int j=a-i-1;j<#!!@blank@;j++){\r\n                b[a-i-1][j]=0;\r\n                b[a+i-1][j]=0;\r\n                b[j][a-i-1]=0;\r\n                b[j][a+i-1]=0;\r\n            } \r\n        }\r\n    }\r\n    for(int i=0;i<c;i++){\r\n        for(int j=0;j<c;j++){\r\n            if(b[i][j]==1){\r\n                printf(\"〇\");   \r\n            }else{\r\n                printf(\"◆\");\r\n            }\r\n\r\n        }\r\n        printf(\"\\n\");\r\n    }\r\n    return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["i","i+1","i-1","i+c"]},{"option": ["i","i+1","i-1","i+c"]},{"option": ["c-a","a-e","c-e","a-i"]},{"option": ["a+i","c+i","a+1","c-1"]},{"option": ["a+i","c+i","a+1","c-1"]}]', '["i-1","i+1","a-e","a+i","a+i"]', '数（不正解）');
