(541, '<p><img src=\"data:image/png;base64,', 'C', '/*\r\n正整数を読み込み、異なる数字の個数を出力せよ。\r\nただし、複数の正整数について行い、データの最後は0とする。\r\n*/\r\n\r\n#include <stdio.h>\r\n\r\nint main(void) {\r\n	int a, /* 正整数。*/\r\n	f[10], /* f[i]:数字iの個数。*/\r\n	i,\r\n	k, /* 異なる数字の個数。*/\r\n	r; /* 桁の数字。*/\r\n	while( 1 ) {\r\n		scanf(\"%d\",&a);\r\n		if(  #!!@blank@ ) { \r\n			break;\r\n		}\r\n		for( i=0; i<=9; i++ ) { \r\n			f[i] = 0; \r\n		}\r\n		while(  #!!@blank@ ){\r\n			r =  #!!@blank@;\r\n			f[r]++;\r\n			a =  #!!@blank@;\r\n		}\r\n		k = 0;\r\n		for( i=0; i<=9; i++ ) {\r\n			if(  #!!@blank@ > 0 ) {\r\n				k =  k+1;\r\n			}\r\n		}\r\n		printf(\"%d\\n\", #!!@blank@);\r\n	}\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["a == 0","a != 0","i <= 9","a > 0","i < 0"]},{"option": ["f[r] >0","a>0","f[r] != a","a < 0","a = 0"]},{"option": ["f[i]","a%10","0","r+f[r]","a*f[r]"]},{"option": ["a*10","a-10","a%10","a+10","a/10"]},{"option": ["a","k","f[i]","r","f[k]"]},{"option": ["a","i","k","r","f[10]"]}]', '["a == 0","a>0","a%10","a/10","f[i]","k"]', '数（不正解）');
