td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>/* 配列に格納する数値を入力 */</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>printf</code><code>(</code><code>&quot;%d個の数値を入力 \\n&quot;</code><code>, total);</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>for</code>&nbsp;<code>(i=0; i&lt;total; ++i)</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>scanf</code><code>(</code><code>&quot;%d&quot;</code><code>, &amp;number[i]);</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>/* 数値を昇順にソート */</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>for</code>&nbsp;<code>(i=0; i&lt;total; ++i) {</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>for</code>&nbsp;<code>(j=i+1; j&lt;total; ++j) {</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>if</code>&nbsp;<code>(number[i] &gt; number[j]) {</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>tmp =&nbsp; number[i];</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>number[i] = number[j];</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>number[j] = tmp;</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>}</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>}</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>/* 昇順ソートした数値を出力 */</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>printf</code><code>(</code><code>&quot;昇順ソートした数値\\n&quot;</code><code>);</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;</code><code>for</code>&nbsp;<code>(i=0; i&lt;total; ++i)</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>&nbsp;&nbsp;&nbsp;&nbsp;</code><code>printf</code><code>(</code><code>&quot;%d\\n&quot;</code><code>, number[i]);</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td><code>}</code></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'C', '#include <stdio.h>\r\n  \r\nint main(void)\r\n{\r\n \r\n  int i, j, tmp;\r\n \r\n  /* 数値を格納する配列 */\r\n  int number[100];\r\n \r\n  /* 数値の総数を入力 */\r\n  int total;\r\n  printf(\"入力する数値の総数 = \");\r\n  scanf(\"%d\", #!!@blank@);\r\n \r\n  /* 配列に格納する数値を入力 */\r\n  printf(\"%d個の数値を入力 \\n\", total);\r\n  for (i=0; i<total; ++i)\r\n    scanf(\"%d\", &number[i]);\r\n \r\n  /* 数値を昇順にソート */\r\n  for (i=0; i<total; ++i) {\r\n    for (j=i+1; j<total; ++j) {\r\n      if (number[i] > number[j]) {\r\n        tmp =  number[i];\r\n        number[i] = number[j];\r\n        number[j] = tmp;\r\n      }\r\n    }\r\n  }\r\n \r\n  /* 昇順ソートした数値を出力 */\r\n  printf(\"昇順ソートした数値\\n\");\r\n  for (i=0; i<total; ++i)\r\n    printf(\"%d\\n\", number[i]);\r\n}\r\n', '{"example1": {"in": "", "out": ""}}', 30, '[{"option": ["total","&total"]}]', '["&total"]', '数（不正解）');
