(742, '<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\n#define NUM 100\r\nint main(void) {\r\n  int a[NUM], i, j, num, x;\r\n  scanf(\"%d\", &num);\r\n  for( i=0; i<num; i++ ) {\r\n    scanf(\"%d\", &a[i]);\r\n  }\r\n  for( i=0; i<num; i++ ) {\r\n    printf(\"a[%d] = %d\\n\", i, a[i]);\r\n  }\r\n  scanf(\"%d %d\", &j, &x);\r\n  #!!@blank@ {\r\n    a[i+1] = a[i];\r\n  }\r\n  #!!@blank@;\r\n  #!!@blank@;\r\n  for( i=0; i<num; i++) {\r\n    printf(\"a[%d] = %d\\n\", i, a[i]);\r\n  }\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["for( i=0; i<num; i++)","for( i=0; i<j; i++)","for( i=num-1; i>j; i--)","for( i=num-1; i>j-1; i--)"]},{"option": ["a[j] = x","a[i] = x","a[i] = j","a[j] = i"]},{"option": ["a[x] = i","a[i] = x","x++","num++"]}]', '["for( i=num-1; i>j-1; i--)","a[j] = x","num++"]', '数（不正解）');
