(743, '<p><img src=\"data:image/png;base64,', 'C', '#include <stdio.h>\r\n#define NUM 100\r\nint main(void) {\r\n  int a[NUM], i, j, num, x;\r\n  scanf(\"%d\", &num);\r\n  for( i=0; i<num; i++ ) {\r\n    scanf(\"%d\", &a[i]);\r\n  }\r\n  for( i=0; i<num; i++ ) {\r\n    printf(\"a[%d] = %d\\n\", i, a[i]);\r\n  }\r\n  scanf(\"%d %d\", &j, &x);\r\n  #!!@blank@ {\r\n    a[i+1] = a[i];\r\n  }\r\n  #!!@blank@;\r\n  #!!@blank@;\r\n  for( i=0; i<num; i++) {\r\n    printf(\"a[%d] = %d\\n\", i, a[i]);\r\n  }\r\n  return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["for( i=0; i<num; i++)","for( i=0; i<j; i++)","for( i=num-1; i>j; i--)","for( i=num-1; i>j-1; i--)"]},{"option": ["a[j] = x","a[i] = x","a[i] = j","a[j] = i"]},{"option": ["a[x] = i","a[i] = x","x++","num++"]}]', '["for( i=num-1; i>j-1; i--)","a[j] = x","num++"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(744, '<p><p><img src=\"data:image/png;base64,\" style=\"width:500px\" /></p>\r\n<br />\r\n\r\n<img src=\"data:image/png;base64,\"width=\"500px\">\r\n</p>\r\n', 'C', '#include <stdio.h>\r\n\r\n/* 探索対象の配列 -- 11個 */\r\nint arry[] = {1, 3, 5, 8, 12, 16, 19, 24, 26, 31, 35};\r\n\r\nint main(void)\r\n{\r\n  /* 配列の範囲を狭めるための添字 */\r\n  int lowid, midid, highid;\r\n  int target;\r\n\r\n  int i;\r\n  printf(\"探索対象の値 : \");\r\n  for (i=0; i<=10; i++) {\r\n    printf(\"%2d, \", arry[i]);\r\n  }\r\n  printf(\"\\n探索する値:\");\r\n  scanf(\"%d\", &target);\r\n\r\n  /* 添字の範囲を初期化 */\r\n  highid = 10;\r\n  lowid = 0;\r\n\r\n  /* 値が見つかるまで繰り返す */\r\n  while (lowid <= highid) {\r\n    midid = (lowid + highid) / 2;\r\n    if (#!!@blank@) {\r\n      printf(\"値 %d は %d 番目に見つかりました\\n\", target, midid+1);\r\n      return (0);\r\n    } else if (#!!@blank@) {\r\n      lowid = midid + 1;\r\n    } else {\r\n      #!!@blank@;\r\n    }\r\n  }\r\n  printf(\"見つかりませんでした\\n\");\r\n  return (0);\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["arry[lowid] == target","arry[midid] == target","arry[highid] == target","arry[midid] != target"]},{"option": ["arry[midid] < target","arry[midid] > target","arry[highid] < target","arry[lowid] < target"]},{"option": ["midid++","highid++","highid = midid - 1","highid = midid + 1"]}]', '["arry[midid] == target","arry[midid] < target","highid = midid - 1"]', '数（不正解）');
INSERT INTO blank_select_questions (question_id, explain, language, base_code, stdinout, max_exec_time, select_blank, correct_blank, hint_type) VALUES
(745, '<p>基数ソート（radix sort）は、 この欠点を少しでもマシにした、 「バケットソート」の改良版ともいえるアルゴリズムです。 基数（radix）というのは、10進数の10、16進数の16というように、 桁上がりの基準になる数のことです。 基数ソートの発想は、要するに、 「桁ごとに「バケットソート」を繰り返す」というものです。 そうすることで、必要となるバケツの数を基数分（10進数で1桁ずつソートするなら10個で OK）に抑えられます。 基数ソートでも、もちろん、 ソートできる値の桁数に制限が生じますが、 コンピュータ上で扱える整数の桁なんてたかが知れている （例えば、32ビット整数で、10進数10桁） ので、 実質上は、整数なら値の範囲を気にせず、計算量 O(n) でソートができます。</p>\r\n\r\n<p>&nbsp; <img src=\"data:image/png;base64,', 'C', '#include<stdio.h>\r\n#define NUM_DATA 1000\r\n\r\nstatic int rad[NUM_DATA];    /* 基数をしまう配列  */\r\nstatic int y[NUM_DATA];      /* 作業用配列 */\r\n\r\n/* n 個のデータを表示する */\r\nvoid ShowData(int x[], int n)\r\n{\r\n	int i;\r\n\r\n	for (i = 0; i < n ; i++)\r\n		printf(\"%d \", x[i]);\r\n}\r\n\r\nvoid radix_sort (int x[], int n, int r){/* n：データの数 */\r\n	int i, j, k;                        /* r：基数を取り出す最大値 */\r\n	int m = 1;                          /* 基数を取り出す桁 */\r\n	#!!@blank@ {\r\n		for (i = 0; i < n; i++)\r\n			rad[i] = #!!@blank@;   /* 基数を取り出し rad[i] に保存 */\r\n\r\n		k = 0;                          /* 配列の添字として使う */\r\n		for (i = 0; i <= 9; i++)        /* 基数は 0 から 9 */\r\n			for (j = 0; j < n; j++)\r\n				if (rad[j] == i)        /* 基数の小さいものから */\r\n					#!!@blank@     /* y[ ] にコピー */\r\n\r\n		for (i = 0; i < n; i++)\r\n			x[i] = y[i];                /* x[ ] にコピーし直す */\r\n\r\n		/*  途中経過を表示  */\r\n		printf(\"\\nソート中: \");\r\n		ShowData(x, n);\r\n		m *= 10;                        /*  基数を取り出す桁を一つ上げる */\r\n	}\r\n}\r\n\r\nint main (){\r\n	int i, n, a[1000];\r\n	int r = 1000;      /* ソートするデータから取り出す基数の上限 */\r\n	printf (\"Enter the number of items to be sorted: \");\r\n	scanf (\"%d\", &n);\r\n	printf (\"Enter items: \");\r\n	for (i = 0; i < n; i++){\r\n		scanf (\"%d\", &a[i]);\r\n	}\r\n	\r\n	radix_sort (a, n, r);\r\n	printf (\"\\nSorted items : \");\r\n	for (i = 0; i < n; i++)\r\n		printf (\"%d \", a[i]);\r\n	printf (\"\\n\");\r\n	return 0;\r\n}', '{"example1": {"in": "", "out": ""}}', 5, '[{"option": ["while (m >= r)","while (m <= r)","while (m == r)","while (m =! r)"]},{"option": ["(x[i] / m) * 10","(x[i] * m) % 10","(x[i] * m) * 10","(x[i] / m) % 10"]},{"option": ["y[k--] = x[j];","y[k*2] = x[j];","y[k++] = x[j];","y[k/2] = x[j];"]}]', '["while (m <= r)","(x[i] / m) % 10","y[k++] = x[j];"]', 'なし');
